INSERT INTO `descriptions` VALUES (5,30,'<h3>Laptop APPLE MacBook Pro 2021 16 &quot; MK183SA / A owns powerful performance with M1 Pro chip along with Ram and hard drive with large capacity. Combined with a luxurious and trendy design, this will be the laptop that gives you the best learning and working experience.</h3>\r\n\r\n<p>&nbsp;</p>','<p><strong>Trendy luxury look, sharp images with vibrant colors</strong></p>\r\n\r\n<p>MacBook Pro 2021 is wrapped in monolithic metal with extremely delicate square beveled cuts and a silver coating to create luxury and fashion for laptops. With a weight of 2.1kg and dimensions of 35.57 x 24.81 x 1.68 cm, you can still fit in a backpack or handbag when moving as well as easily hold it in your hand without causing bulkiness.</p>\r\n\r\n<p>This is the Macbook with the best ultra-thin bezel screen with a size of 16 inches and Liquid Retina XDR display resolution and high dynamic color range for the ability to display up to 1 billion colors. Keep images sharp with vivid vibrant colors. With a 120Hz refresh rate, everything from surfing the web to gaming is super smooth and responsive.</p>\r\n\r\n<p>Moreover, bringing you HD quality calls with webcam. Make online calls when studying and working or Facetime with friends and relatives easier.</p>\r\n\r\n<p><strong>Conquer all tasks with outstanding performance, 16GB Ram and 512GB SSD storage</strong></p>\r\n\r\n<p>Apple has not hesitated to equip Apple M1 Pro chip into MacBook Pro 2021 MK183SA / A to bring outstanding performance with 10 cores including 8 high-performance cores and 2 power-saving cores. Help you easily handle tasks from basic to complex in the smoothest and gentlest way.</p>\r\n\r\n<p>Comes with an integrated graphics card of up to 16 GPU cores to enhance outstanding graphics performance. Allows professional image processing to help you unleash your creativity and edit images, content such as video rendering or 3D rendering, faster 4K video rendering speed on professional photo editing and design software.</p>\r\n\r\n<p>With 16GB of Ram memory, Apple equips the Macbook for smooth multitasking. You can simultaneously open multiple web windows, applications or software as well as switch back and forth smoothly without any standing or jerking.</p>\r\n\r\n<p>With 512GB of internal memory, SSD standard is equipped into this high-end laptop, giving you a large space to comfortably store personal data such as photos or videos, files to support work and study. At the same time, it allows you to start or open applications with extremely fast response times.</p>\r\n\r\n<p><strong>Responsive typing experience with high accuracy, fingerprint security</strong></p>\r\n\r\n<p>The Magic Keyboard of the MacBook Pro 2021 is equipped with a new row of function keys for Siri, Spotlight, Siri, Do Not Disturb, and Dictation. Along with that is a keyboard with good bounce with reasonable key travel for you to experience fast, flexible typing with high accuracy.</p>\r\n\r\n<p>Extremely high security with Touch ID helps you unlock or access applications that use security features quickly with just 1 light touch. Moreover, Touch ID also has 1 new tactile ring that shows how to place your finger correctly to unlock it quickly and safely. The Macbook Pro also uses the macOS operating system.</p>\r\n\r\n<p><strong>Common communication ports, impressive battery life of 100Wh</strong></p>\r\n\r\n<p>Apple has fully equipped the communication port into its high-end Macbook to make connecting laptops to different peripherals easier and more convenient. Includes 1 HDMI output port and 3 Thunderbolt 4 connectors.</p>\r\n\r\n<p>Along with WiFi 802.11ax wireless connectivity standard Wifi 6 and Bluetooth 5.0 help you work, study and play seamlessly. For the ability to access the internet at high speed and fast with a stable connection.</p>\r\n\r\n<p>With a 100Wh battery, Apple equips the Macbook Pro 2021 for up to 21 hours of video playback time and up to 14 hours of wireless web browsing capabilities. Besides, the laptop will be fully recharged in just about 2 hours with fast charging technology with MagSafe charging port.</p>',2.100,'35.57 x 24.81 x 1.68','1080P FULL HD','macOS',100,12,'2023-03-03 04:37:14','2023-03-09 13:15:51'),(6,31,'<h2>Laptop MacBook Air 2020 13.3&quot; MGND3SA/A is a high-end model because it is equipped with Apple M1 processor, combined with 256GB SSD hard drive to handle tasks quickly. convenient and suitable for those who are studying or working, especially at work.</h2>','<p><strong>Exquisite and luxurious design, optimal anti-glare screen thanks to IPS panels</strong><br />\r\nAttracting the eye thanks to its delicate design, combined with the yellow tone, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop also stands out thanks to the shiny metal-plated Apple logo placed in the middle of the machine.</p>\r\n\r\n<p>At the same time, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop has a compact size, only 21.24 x 30.41 x 1.61cm and weighs only about 1.3kg, making it easy to take to work or study anywhere.</p>\r\n\r\n<p>In addition, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop owns a 13.3-inch wide screen with a resolution of up to 2560 x 1600 pixels, incorporating True Tone technology to automatically adjust colors, giving you a visual experience. more realistic and natural images.</p>\r\n\r\n<p>The unique feature of the MacBook Air 2020 13.3&quot; MGND3SA/A laptop is the thin screen border design, which increases the image display area, giving you a wide viewing angle experience when working, playing games or watching. movie.</p>\r\n\r\n<p><strong>Top notch Apple M1 processor, 8GB RAM provides smooth multitasking</strong><br />\r\nEquipped with Apple M1 processor, MacBook Air 2020 13.3&quot; MGND3SA/A laptop can use office applications, entertainment, graphics software, vlog editing, image and video editing smoothly. without worrying about interruptions.</p>\r\n\r\n<p>Combined with 8GB LPDDR4 RAM with 3733MHz processing speed, it increases the ability to perform multitasking tasks smoother on the MacBook Air 2020 13.3&quot; MGND3SA/A laptop.</p>\r\n\r\n<p><strong>256GB SSD hard drive provides comfortable storage space, quite durable battery life</strong><br />\r\nThe MacBook Air 2020 13.3&quot; MGND3SA/A laptop is equipped with a 256GB SSD hard drive that helps the machine to quickly process tasks and provide a more comfortable storage space for users.</p>\r\n\r\n<p>In addition, with the quite long battery life of the MacBook Air 2020 13.3&quot; MGND3SA/A laptop, you can use the device continuously without worrying about being interrupted by the battery running out, limiting charging repeatedly causing bottles. the battery.</p>\r\n\r\n<p>A variety of convenient connection ports, the keyboard is very responsive and extremely smooth to use<br />\r\nEquipped with two Thunderbolt 3 ports that combine bandwidth with high speed, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop can transfer data, compatible with a variety of cables and adapters. Wireless connectivity includes: WiFi 802.11ax (Wifi 6) and Bluetooth 5.0.</p>\r\n\r\n<p>I<strong>n addition, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop is equipped with an extremely responsive keyboard, fast speed and good response, and is also equipped with an LED light system so you can work efficiently. better in low light.</strong></p>\r\n\r\n<p>Moreover, due to its large and responsive touchpad, along with an impressive response speed, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop allows you to comfortably operate anywhere on the touchpad. response.</p>\r\n\r\n<p>Superior fingerprint security system, macOS operating system to support learning and entertainment<br />\r\nThe super-advanced Touch ID fingerprint sensor technology has helped the MacBook Air 2020 13.3&quot; MGND3SA/A laptop to better secure your information and data, and help open the machine quickly.</p>\r\n\r\n<p>Not only that, the MacBook Air 2020 13.3&quot; MGND3SA/A laptop is also supported to install macOS operating system with a large application store, helping you in the learning and entertainment process, meeting all your needs well. set.</p>',1.300,'30.41 x 21.24 x 0.41','HD','macOS',10000,12,'2023-03-03 07:40:32','2023-03-09 04:56:59'),(7,32,'<h2>Laptop MacBook Pro 2021 16 &quot; MK1E3SA / A breaks the limit with outstanding power from Apple&#39;s proprietary M1 chip. With exquisite luxury beauty and powerful configuration, the new generation Macbook Pro version 2021 promises to bring iFan impressive new experiences.</h2>','<p><strong>Premium elegant design, sharp frame experience</strong>&nbsp;</p>\r\n\r\n<p>MacBook Pro 2021 wears a luxurious look with a delicate silver color, combining a monolithic metal design, adorning all your workspaces. With a weight of 2.1 kg and a thickness of 16.8 mm, the laptop becomes thin and flexible to be ready to follow you anytime, anywhere.</p>\r\n\r\n<p>Wide screen with a size of 16 inches with a thin bezel design, optimizing the display space for a more realistic experience. Impressive resolution of up to 3456 x 2234 pixels with 1 billion colors, brilliant beautiful frame reproduction with lifelike details, effective support in professional graphics work as well as providing excellent entertainment quality.</p>\r\n\r\n<p>HD Webcam brings clear images, ensuring no blur so you can easily join video calls, study or work remotely through popular software such as Skype, Zoom, Google Meet,...</p>\r\n\r\n<p><strong>Top performance with Apple M1 Pro chip, 16GB RAM; large storage 512GB</strong></p>\r\n\r\n<p>MacBook Pro 2021 harnesses the power from the Apple M1 Pro chip including 2 power-saving cores and 8 high-performance cores, improving working performance by 1.7 times compared to the previous generation. Users can enhance graphics productivity, achieve maximum work efficiency with amazingly powerful performance.</p>\r\n\r\n<p>16GB RAM (expandable to up to 32GB), supports the ability to multitask multiple tasks at the same time effectively, allowing users to open and work with many applications with smooth smoothness, ensuring no lag.</p>\r\n\r\n<p>The new generation Macbook Pro is integrated with 512GB memory, allowing you to freely store information and images,... SSDs also offer fast read and write speeds, instant responses, and optimized startup times and opening your applications.</p>\r\n\r\n<p><strong>Advanced connection integration, macOS installation</strong></p>\r\n\r\n<p>MacBook Pro 2021 is integrated with advanced ports, including: 1 HDMI port, 3 Thunderbolt 4 ports that allow users to expand the connection quickly when necessary with impressive transfer speeds. Wi-Fi 6 wireless connection standard (802.11ax), Bluetooth 5.0 supports a smooth connection, maintaining stability to ensure your work goes throughout.</p>\r\n\r\n<p>The high-end Macbook Pro brings a huge store of applications and entertainment on macOS Big Sur, with an interface that displays all the necessary content. Users can share, create with improved features. Facetime calls allow users to easily connect with friends and relatives.</p>\r\n\r\n<p><strong>Modern keyboard, long battery life</strong></p>\r\n\r\n<p>MacBook Pro 2021 is equipped with an easy-to-operate Magic Keyboard, with good key travel, high bounce giving users a smooth, accurate feeling when typing text. Force Touch mouse is spacious, for fast response speed to ensure smooth operation and work.</p>\r\n\r\n<p>Touch ID fingerprint security layer allows users to open the device quickly, conveniently pay online, open data with just one touch without having to enter a complicated and time-consuming password.</p>\r\n\r\n<p>The Macbook works durable with a 100Wh battery, allowing you to comfortably work for hours without worrying about interruptions. The convenient MagSafe charging port saves you time charging your battery. With many highlights, MacBook Pro 2021 MK1E3SA/A is a great choice that gives you outstanding performance experiences that are worth experiencing.</p>',2.100,'35.5 x 12.5 x 9.6','HD','macOS',100,12,'2023-03-03 14:04:41','2023-03-09 08:23:43'),(9,34,'<h2>The product lines of the Apple brand are always appreciated for quality as well as in shape and design. If you are in need of a thin, light, compact laptop for easy carrying, choosing the Apple MacBook Air 2020 MGN63SA/A Laptop is extremely reasonable.</h2>','<p><strong>Stylish gray aluminum case. Minimalist, sophisticated design</strong><br />\r\nThe Apple MacBook Air 2020 MGN63SA/A laptop has a manufacturer-recommended case made from 100% recycled aluminum that contributes to environmental protection and provides high durability for this laptop. Because this is a good impact resistant material, it is able to protect the machine&#39;s components in the event of a strong impact.</p>\r\n\r\n<p>The MacBook Air 2020 MGN63SA/A has a size of 30.41 x 21.24 x 0.41&ndash;1.61 cm, which brings the advantage of a compact appearance to this computer compared to other products in the same segment. The device weighs only about 1.3kg, allowing users to comfortably carry it with them all day long without any inconvenience.</p>\r\n\r\n<p><strong>High-resolution 13.3-inch widescreen display for vivid picture quality</strong><br />\r\nApple Macbook&nbsp;Air 2020 MGN63SA/A laptop is equipped with a 13.3-inch wide screen with a resolution of up to 2560 x 1600 pixels for sharp display image quality, vivid and true colors.</p>\r\n\r\n<p>In addition, the screen of this computer also uses a non-touch IPS panel. As a result, this screen has a relatively wide viewing angle, viewers can comfortably look at any angle and can see the image displayed on it.</p>\r\n\r\n<p><strong>Configuration has improved compared to the previous generation with Apple M1 processor, 8GB RAM, 256GB SSD hard drive</strong><br />\r\nAPPLE MacBook Air 2020 MGN63SA/A is integrated with Apple M1 processor with improved manufacturing technology, this CPU delivers up to 3.5 times faster processing performance than the previous generation of Apple CPUs. . It can handle 3D graphics tasks with very modest power consumption.</p>\r\n\r\n<p>Using 8GB Onboard LPDDR4 3733MHz internal memory and a 256GB SSD hard drive not only provides a relatively spacious storage space for users but also increases the processing power of this computer. It can handle multi-tasking tasks smoothly and quickly, and the processing speed of computer operations is extremely fast such as opening and closing tabs, starting the computer, ....</p>\r\n\r\n<p><strong>Magic Keyboard keyboard provides impressive typing experience</strong><br />\r\nThe Apple MacBook Air 2020 MGN63SA/A laptop uses a keyboard specifically designed for Apple product lines: Magic Keyboard. The keystroke is only 1mm, the bounce is good and smooth, providing an impressive typing experience for users of this laptop.</p>\r\n\r\n<p>The keyboard is also equipped with LED lights to help users use it in low light conditions, which is very convenient.</p>\r\n\r\n<p><strong>Connect quickly with Thunderbolt 3 and other wireless technologies</strong><br />\r\nWith data transfer power 2 times faster than the previous generation, 2 Thunderbolt 3 ports provide fast, convenient connectivity for MacBook Air 2020 MGN63SA/A with other electronic peripherals. .</p>\r\n\r\n<p>In addition, users can also quickly connect it to other wireless devices for data transmission by WiFi 802.11ax and Bluetooth 5.0 technology. These are all the latest generation standard wireless connection technologies integrated on this high-end laptop. Faster, smoother transmission speeds bring great user experiences</p>\r\n\r\n<p><strong>Exclusive macOS operating system on Apple products</strong><br />\r\nAPPLE MacBook Air 2020 MGN63SA/A uses the macOS operating system with many new interface improvements, the operations on the machine become smoother and smoother to bring maximum convenience to the user.