h a full range of connectivity ports.<br />\r\n- Left side: 1 x DC-in, 1 x HDMI, 1 x USB Type-C, 1 x MicroSD Reader Card.<br />\r\n- Right side: 2 x USB 3.2, 1 x Jack Audio 3.5mm</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>7 - &nbsp;WIFI STANDARD, NEW STANDARD BLUETOOTH &amp; &nbsp;INCREDIBLE SOUND</strong></p>\r\n\r\n<p>Wireless connection standard Wi-Fi 6 802.11ax + Bluetooth&reg; 5.2 helps to connect quickly, for a more stable and smoother data transmission speed than the previous generation. - Msi modern 14 uses modern sound: If you have the opportunity to equip with a good headset or external speaker to plug into the machine, you can enjoy the cinema-standard virtual surround sound effect.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',1.400,'31.99 x 22.3 x 1.935','yes','Win 11',39,12,'2023-03-09 07:05:25','2023-03-09 07:05:25'),(21,46,'<h2><strong>The MSI Creator M16 A12UC i7 laptop (292VN) owns the powerful, angular lines and outstanding performance of the 12th generation Intel chip &nbsp;, ready to take you into a new era of technological beauty, breaking all the worlds. limited to creative users.</strong></h2>\r\n\r\n<p>&nbsp;</p>','<p><strong>Impressive performance tackles any creative challenge</strong></p>\r\n\r\n<p>The MSI Creator laptop carries with it an advanced Intel Core i7 12700H CPU , more power efficient combined with an &nbsp;RTX 3050 4 GB graphics card. I tested the performance of the machine through Cinebench R23 software, the single-core and multi-core scores were 1792 and 14885 , respectively . With the measured results, I find the machine can run smoothly most of the professional editing applications, the highlight gives users a powerful configuration, serving the needs of a graphics laptop &nbsp;- technical .</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The device owns<strong> 16 GB RAM</strong> for the ability to run multiple applications smoothly. I have the experience of writing a thesis at the same time opening 20 Chrome tabs to search for information, listen to music, ... without jerks, freezes.</p>\r\n\r\n<p><strong>MSI Creator laptop</strong> owns a &nbsp;<strong>512 GB SSD</strong> hard drive for fast data access speed, I&#39;m impressed that it takes less than 10 seconds to boot up and open Photoshop. The storage space in my opinion is enough, but to expand the memory, it is recommended that you upgrade the SSD to have storage space for larger files.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>After doing my work, I played League of Legends to relax. The laptop runs well from 240 to 250 FPS at maximum graphics settings, stabilizing each frame without jerking, lag when launching. However, I think this is a machine that better meets work than gaming because the manufacturer has focused on creative users rather than entertainment needs.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The rendering ability of the machine is also impressive, equipped with <strong>&nbsp;Intel Core i7 12700H</strong> CPU combined with &nbsp;<strong>4 GB RTX 3050</strong> video card to bring outstanding power. I tried rendering a short video of about 5 minutes , the machine runs smoothly and stably without any freeze or sudden heat.</p>\r\n\r\n<p><strong>Display space unlocks limitless imagination</strong></p>\r\n\r\n<p>The MSI laptop is equipped with a <strong>16-inch screen with QHD+ (2560 x 1600)</strong> resolution , 500 nits brightness that provides sharp image quality, helping you monitor clear images even when sitting in a place with high intensity. strong light, open space,...</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>IPS technology for wide viewing angles up to 178 degrees . When experiencing YouTube with friends, sitting in different positions, but the screen still displays vivid colors, clear image quality in every viewing position.</p>\r\n\r\n<p>I have checked the screen quality through Spyder 5 Pro software , the results are impressive with 100% sRGB , 90% Adobe RGB , 100% DCI-P3 . With the measured data, I am sure this is one of the machines with a screen that achieves true, accurate color on each frame, which the name &quot;Creator&quot; means creative users are very interested in.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The MSI True Color display feature allows you to change color modes according to individual needs such as: sRGB, Adobe RGB, DCI-P3,... in addition, it can also balance the colors to suit the job. daily work.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>Mysterious beauty and charm.</strong></p>\r\n\r\n<p>The minimalist design style but still exudes the elegance of this laptop in every space thanks to the durable metal shell covered with modern gray paint, giving a cool feeling when touching the surface of the machine. The weight of 2.26 kg &nbsp;will be a bit heavy for women, but in return, it also makes the machine very solid and durable.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>The 180-degree hinge</strong> makes it easy to share what&#39;s on the screen with everyone. Especially when I go to a group study, or when I sit at a coffee shop, I don&#39;t need to rotate the whole machine, but just need to open it 180 degrees so that the opposite person can monitor the content on the screen.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The air inlet slot is arranged by the MSI house on both sides to help the machine dissipate heat better, bringing coolness. I consider this factor very important when working for a long time, the palm rest does not heat up, does not cause discomfort when manipulating the surface of the machine.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>I have experienced text editing on Word, the deep key stroke helps me not to have difficulty when manipulating, the good bounce also helps me type correctly. In addition, MSI allows the keyboard backlight to also support 3 levels of brightness: low light, medium light, strong light, allowing you to choose the appropriate brightness intensity in each location like in your office using a medium level, or When I sit in a cafe during the day, I use high light.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>MSI laptop is equipped with a 53.5 Wh battery , but it is a high-performance laptop, so the power consumption will also be more, I encourage you to always plug in the charger to not interrupt your work and promote the maximum performance of the machine. .</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p>The device is also fully equipped with communication ports including: USB, HDMI, headphone jack, LAN, USB Type-C. Featured with a USB Type-C port that supports very fast connection and data retrieval.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>Built-in useful technology</strong></p>\r\n\r\n<p>The level of security is increased when the laptop is equipped with one-touch fingerprint security , saving me more time when logging in with just a touch without entering a password. The fingerprint sensor position is located to the left of the touchpad (touchpad) easy to remember and convenient when working on the machine.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<p><strong>MSI Creator M16 A12UC i7 12700H (292VN)</strong> - Fingerprint Security Realtek High Definition Audio technology amplifies the sound quality when playing games, watching movies, listening to music, ... brings quality sound, without distortion, helping users have an immersive entertainment and relaxation space.</p>\r\n\r\n<p>&nbsp;</p>',2.300,'35.9 x 25.9 x 2.395','yes','Win 11 Home',53,12,'2023-03-09 07:34:07','2023-03-09 07:34:07'),(22,47,'<h2>Apple&#39;s products always attract users by luxury in design as well as top quality and the Macbook Pro line is not an exception. With an ultra-thin and light design and a compact 13-inch screen for flexible movement. This Apple laptop is sure to satisfy you from image to configuration.</h2>','<h3><strong>Luxurious, compact design with a case made of monolithic metal</strong></h3>\r\n\r\n<p>Macbook Pro Z16R0003V has a luxurious appearance with an impressive compact size of only<strong>&nbsp;30.41 x 21.24 x 1.56cm</strong>&nbsp;and a weight of&nbsp;<strong>1.4kg</strong>, so you can easily hold one hand and take it with you to use anytime, anywhere.</p>\r\n\r\n<p>Besides, a plus point on this MacBook is that it has a solid, meticulous hinge and can push the lid with one hand extremely conveniently, saving significant time for users. In addition, the case material is finished from monolithic metal to provide a strong grip, limiting fingerprint attachment and helping to increase the luxury of this laptop.</p>\r\n\r\n<h3><strong>Superior configuration on Apple M2 CPU, 13.3-inch screen with Retina technology</strong></h3>\r\n\r\n<p>Apple M2 CPU on Apple laptops is a proprietary chip that only appears on Apple laptops for powerful performance and 2 times more performance than the<strong>&nbsp;Apple M1</strong>&nbsp;chip to help you handle many tasks from basic to complex. The configuration has&nbsp;<strong>8 cores,</strong>&nbsp;<strong>16 threads&nbsp;</strong>to save energy consumption and smooth support with professional graphics jobs.</p>\r\n\r\n<p>With a compact design, the&nbsp;<strong>Macbook Pro&nbsp;</strong>is still<strong>&nbsp;</strong>equipped with a&nbsp;<strong>13.3-inch</strong>&nbsp;screen that is not too small, just enough for you to work comfortably. Besides, this MacBook supports&nbsp;<strong>Retina&nbsp;</strong>display technology along with an impressive resolution of<strong>&nbsp;2560 x 1600 pixels</strong>&nbsp;for super-sharp image reproduction, realistic display colors.</p>\r\n\r\n<h3>256GB storage, 16GB multitasking RAM</h3>\r\n\r\n<p>One of the most important things when choosing a laptop is to choose a laptop with a large capacity, fortunately, the 13-inch MacBook Z16R0003V has a large&nbsp;<strong>memory of 256GB</strong>&nbsp;to help you store just enough documents and files without worrying about full memory.</p>\r\n\r\n<p>In addition,&nbsp;<strong>MacBook</strong>&nbsp;owns a large&nbsp;<strong>16GB</strong>&nbsp;<strong>RAM&nbsp;</strong>memory that you can use comfortably when accessing, opening many applications and websites smoothly without lag.</p>\r\n\r\n<h3>Good battery life, keyboard usually supports LEDs</h3>\r\n\r\n<p>The MacBook Pro M2 has a<strong>&nbsp;58Wh&nbsp;</strong>tablet that can be used for many hours with your basic, normal daily tasks or used comfortably in a meeting or work without constantly plugging in and out.</p>\r\n\r\n<p>Most especially,<strong>&nbsp;</strong>the 13-inch<strong>&nbsp;</strong>MacBook Pro is equipped with&nbsp;<strong>a keyboard with LED</strong>&nbsp;support that not only increases aesthetics when using but also helps you type comfortably in the dark. Each key is meticulously designed, the key bounce is good and the distance between the keys is perfect and the sound when typing is smooth, low noise.</p>\r\n\r\n<h3>MacOS operating system, many special features</h3>\r\n\r\n<p>MacBook Z16R0003V is equipped with&nbsp;<strong>MacOS operating system&nbsp;</strong>with good security, safety, limiting the penetration of viruses from unknown website sources when you unfortunately visit. Besides, the interface of MacOS is beautiful, easy to use along with a diverse ecosystem that easily connects to other Apple devices quickly.</p>\r\n\r\n<p>In addition, Apple laptops support many special features such as&nbsp;<strong>Ambient Light sensor</strong>&nbsp;that automatically changes the screen brightness depending on the lighting conditions of the outside environment; Touch Bar interface with beautiful interface design with sensitive touch bar, utilities, quick adjustment of many operations.</p>\r\n\r\n<h3><strong>Stay secure with Touch ID, connect quickly</strong></h3>\r\n\r\n<p>Touch&nbsp;<strong>ID-powered</strong>&nbsp;MacBook unlocks one-touch fingerprint with high security when your fingerprint can be read at any 360-degree angle to help protect all important, necessary user information.</p>\r\n\r\n<p>Besides, MacBook Pro is equipped with 2&nbsp;<strong>Thunderbolt 3</strong>&nbsp;connectors that can perform both functions of charging and transferring data. In addition, it also supports&nbsp;<strong>2.802ax WiFi (Wifi 11)</strong>&nbsp;connection with wide coverage, good latency reduction to help connect to the network quickly and&nbsp;<strong>Bluetooth 6.5</strong>&nbsp;for faster connection speed to other wireless devices.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',1.400,'30.41 x 21.24 x 1.56','HD','macOS',58,12,'2023-03-09 07:50:55','2023-03-09 07:50:55'),(23,48,'<h2>APPLE Macbook&nbsp;Pro 2020 MYDC2SA / A&nbsp;is a&nbsp;laptop line from the world&#39;s leading technology brand, owning an advanced Apple M1 chip with impressive performance, 512GB SSD storage hard drive and 13.3 inches IPS screen, the product is a great choice for customers who prefer class.</h2>','<h3><strong>Apple M1 - the most powerful chip that Apple designed for Macbook</strong></h3>\r\n\r\n<p>Apple MacBook Pro 2020 MYDC2SA / A laptop owns the Apple M1 chip line - the most advanced and powerful chip that Apple has ever designed for Macbook, bringing performance and performance many times higher than previous product lines.</p>\r\n\r\n<p>With the Apple M1 chip, the device owns 8 CPU cores, including 4 high-performance cores and 4 power-saving cores. In case the customer performs heavy tasks, the device will make the most of the high-performance cores and vice versa, for simple operations, the machine will automatically switch to using energy-saving cores.</p>\r\n\r\n<p>From there, it can be seen that the device is designed by Apple with the criterion of working efficiently on every watt of power, both bringing powerful performance to serve the needs of customers and extending the use time, helping to save power efficiency.</p>\r\n\r\n<p>In addition, the Apple M1 chip line also integrates an artificial intelligence processing core - Neural Engine, helping software developed and supporting machine learning features to work more efficiently on the device, such as Final Cut Pro or Pixelmator Pro.</p>\r\n\r\n<h3><strong>Simple but luxurious design, ensuring high durability, compact size</strong></h3>\r\n\r\n<p>Apple&nbsp;<a href=\"https://phongvu.vn/macbook-1061.cat\">MacBook</a>&nbsp;Pro 2020 MYDC2SA/A laptop, as well as other Apple product lines, are famous for their sophisticated design. Throughout the body covered with 1 layer of luxurious silver color, the logo is intricately laser engraved and each line is carefully processed to every detail, providing a classy and different look.</p>\r\n\r\n<p>Apple is one of the leading brands in terms of durability of products on the market. Therefore, customers do not need to worry about the usage time of the product. At the same time, with its thin and light size, the device allows you to easily take it with you wherever you go.</p>\r\n\r\n<h3><strong>Ensure high security, integrate Touch ID on the power button</strong></h3>\r\n\r\n<p>Apple MacBook Pro 2020 MYDC2SA/A laptop is designed with security in mind, helping the startup process take place safely, optimally protecting stored information and personal data of customers, limiting unauthorized access, stealing resources.</p>\r\n\r\n<p>In addition, the product also integrates Touch ID on the power button to increase security efficiency, maximize user privacy, and the system also ensures not to grant access to your fingerprint for any access.</p>\r\n\r\n<h3><strong>8GB Onboard LPDDR4 3733MHz RAM Storage, 512GB SSD Storage Hard Drive</strong></h3>\r\n\r\n<p>APPLE MacBook Pro 2020 MYDC2SA/A laptop owns 8GB Onboard LPDDR4 3733MHz RAM for high and smooth task processing speed, optimal support for multitasking, significantly increases device performance, limits stuttering, lag effectively.</p>\r\n\r\n<p>In addition, the product also provides a hard drive with a large storage capacity of 512GB SSD for high read-write speed, stable operation, maintaining data even when the laptop suddenly turns off the power, ensuring durability, helping the laptop operate smoothly, less heat and significantly save power consumption.</p>\r\n\r\n<h3><strong>Own the proprietary operating system MacOS</strong></h3>\r\n\r\n<p>Apple MacBook Pro 2020 MYDC2SA / A laptop owns the exclusive operating system MacOS - famous for its stable, smooth operation, beautiful interface and integrated many features as well as applications only for Apple products.</p>\r\n\r\n<p>Not only that, MacOS also brings graphics strengths to the device, helping to maximize the work related to professional design, along with the ability to synchronize, allowing the process of backing up and sharing data to become easier between Apple devices.</p>\r\n\r\n<p>&nbsp;</p>',1.400,'21.24 x 30.41 x 1.56','HD','macOS',NULL,12,'2023-03-09 07:54:40','2023-03-09 07:54:40'),(24,49,'<h2><strong>Laptop MSI Delta 15 A5EFK - ELECTRICAL&nbsp;AWARENESS&nbsp;</strong></h2>','<p>Unexpected and unpredictable!&nbsp;Ultra-thin and ultra-light with high performance!&nbsp;That&#39;s right, the Delta 15, AMD Advantage &trade; Edition or the MSI Delta 15 A5EFK-095VN Laptop is not only equipped with the latest AMD Ryzen &trade; 9 5900HX Mobile Processor and AMD Radeon &trade; RX 6700M Mobile Graphics.&nbsp;It also has a special design with a weight of 1.9 kg and a thickness of 19mm.&nbsp;An amazingly thin and super light laptop, isn&#39;t it!&nbsp;Not only that, this MSI laptop is also added with advanced SmartShift technology, the latest smart access memory and the latest Wi-Fi 6E wireless access.</p>\r\n\r\n<p>That&#39;s why this year&#39;s MSI Delta 15 Laptop deserves to be one of the Gaming, Graphics Laptops that have all the advantages and powerful performance in a high-end design.&nbsp;It can be said that the MSI Delta 15 Gaming Laptop will lead the changes, break the framework and create a new transformation in the gaming world.</p>\r\n\r\n<h3><strong>A NEW WAY TO BE</strong></h3>\r\n\r\n<p><strong>(img)</strong></p>\r\n\r\n<p>Crafted in an all-aluminum body with a carbon gray metallic finish, the Delta 15 offers a new look and sleek look like never before in Notebook history.</p>\r\n\r\n<h3><strong>POWERED BY THE MOST ADVANCED TECHNOLOGY</strong></h3>\r\n\r\n<p>Built with the latest groundbreaking 7nm technology, the AMD Ryzen&trade; 9 5900HX Mobile Processor with AMD Radeon&trade; RX 6700M Mobile Graphics delivers desktop-class performance in a laptop body gaming to enjoy immersive gaming and multimedia experiences like never before.<br />\r\n*Note: MSI has tested the combination of AMD Ryzen&trade; 9 5900HX Mobile Processor with AMD Radeon&trade; RX 6700M Mobile Graphics and DDR4-3200 dual-channel memory to produce the above results.&nbsp;However, its performance may still vary depending on the configuration.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<h3><strong>AMD SMARTSHIFT TECHNOLOGY</strong></h3>\r\n\r\n<p>AMD SmartShift technology allows the system to automatically change the power supply to maximize or match performance whether you&#39;re gaming or creating content.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>AMD SMART ACCESS MEMORY TECHNOLOGY</strong></h3>\r\n\r\n<p>AMD Ryzen 5000 series mobile processors and AMD Radeon RX 6000M mobile graphics consistently achieve higher performance in some titles through new levels of data transfer to take gaming to a new level of realism with supporting features like DirectX 12 Ray Tracing and Variable Rate Shading.</p>\r\n\r\n<p>(img)</p>\r\n\r\n<h3><strong>FIDELITYFX</strong></h3>\r\n\r\n<h3><strong>IMAGESHARPING</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>THIN &amp; LIGHT</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The MSI Delta 15 A5EFK-095VN laptop is designed to be extremely thin and light so gamers can carry it around every day or play games, study and work in any environment.</p>\r\n\r\n<h3><strong>LIGHT UP YOUR STYLE</strong></h3>\r\n\r\n<p>Customize your RGB lighting keyboard with Mystic Light from MSI Center to match your unique gaming style.</p>\r\n\r\n<p>Not stopping there, the MSI Delta 15 A5EFK-095VN Laptop can also resume immediately from sleep mode.&nbsp;Its performance will be continued in a period of usually less than a second and help you get back to the game faster.</p>\r\n\r\n<p>Faster login, faster instant-on, highly efficient hibernation, faster Wi-Fi connection and notification calls are all that MSI wants to tell you about the new functionality. this &quot;&nbsp;<strong>Modern Standby</strong>&nbsp;&quot;.</p>\r\n\r\n<h3><strong>SMOOTH AND FAST DISPLAY</strong></h3>\r\n\r\n<p>Tailor-made and highly optimized for gamers, Delta 15 comes with high refresh rates and smooth visuals, giving you the ultimate gaming experience at peak screen frequencies up to 240Hz.</p>\r\n\r\n<h3><strong>MULTI-TASK WITH UP TO 3 MONITORS</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Expand your vision across multiple monitors with HDMI and USB Type-C display connectors, and enjoy up to 4K (3840x2160) resolution output for added productivity and fun. is Matrix Display.</p>\r\n\r\n<h3><strong>PERFORM WITH MORE POWER</strong></h3>\r\n\r\n<p>Rechargeable battery life is also an indispensable part of this classy MSI Delta 15 A5EFK-095VN Laptop.&nbsp;It offers incredible runtimes, non-stop fun and non-stop gaming with its massive 82Whrs rechargeable battery capacity.</p>\r\n\r\n<h3><strong>REVOLUTIONARY COOLING FOR NEXT-GEN GAMING</strong></h3>\r\n\r\n<p>By enlarging the inner diameter of the heat pipe and using MSI&#39;s proprietary heatsink grease to ensure maximum performance during extreme gaming, MSI has implemented a dedicated cooling solution on the CPU and GPU in this Delta 15 version with 2 super-wide fans and 6 super-wide heat pipes.</p>\r\n\r\n<h3><strong>POWER THAT LEADS IN THE LATEST STANDARD DDR4-3200 MEMORY</strong></h3>\r\n\r\n<p>&ldquo;Take advantage of the powerful performance from your laptop with support for the latest DDR4-3200 memory, and enjoy faster system speeds and responsiveness, the new standard that will bring the Take your gaming experience to the next level up to 10% and 35%&rdquo; is the true power of DDR4-3200 memory.</p>\r\n\r\n<h3><strong>THE WAY MUSIC SHOULD BE</strong></h3>\r\n\r\n<h3><strong>ELEVATE YOUR AUDIO</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>GET ALL THE BUFFS</strong></p>\r\n\r\n<p>The exclusive MSI Hub helps you control and customize your MSI laptop just the way you want it.&nbsp;It is not only used to monitor, adjust, and optimize useful features built into a unified system.&nbsp;It also offers maximum flexibility with new functions like Smart Image Finder, UI Skin options and more to customize your personal preferences.</p>\r\n\r\n<h3><strong>WINDOWS 11 BRINGS YOU CLOSER TO WHAT YOU LOVE</strong></h3>\r\n\r\n<p>Chatting online with family and friends struggling or creating content, music is becoming an obsession!?&nbsp;Forget that because Windows 11 will be the only place to help you all.&nbsp;Really?&nbsp;With a fresh feel and special tools, Delta 15 with Windows 11 Home/Pro makes it easier to be more productive and it always has what you need for whatever comes next.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',1.900,'35.7 x 24.7 x 1.9','yes','Win 11 Home',82,12,'2023-03-09 07:55:56','2023-03-09 07:55:56'),(25,50,'<h2>APPLE<strong>&nbsp;</strong>MacBook Pro 2020 MYD92SA / A laptop is a high-end laptop designed with an ultra-light weight, creating convenience in moving. The laptop also owns a small processor but brings a great performance, helping to quickly handle all tasks.</h2>','<h3><strong>The design is highly portable, the ultra-light weight is only 1.4 kg, high-quality materials create luxury</strong></h3>\r\n\r\n<p>MacBook Pro 2020 MYD92SA / A brings luxurious beauty with a simple design and a familiar apple logo to create a highlight in the lid. The computer weight is super light, with only 1.4 kg so that users can take their laptop anywhere, whether at work or on long trips.</p>\r\n\r\n<p>The Macbook is made of high-quality materials with standard durability. In addition to protecting the safety of components on the inside, the sturdy frame also helps to create a delicate outer shell, enhancing aesthetic value.</p>\r\n\r\n<h3><strong>Screen with IPS panel, screen size 13.3 inches, sharp images with a resolution of 2560 x 1600; equipped with HD Webcam quality</strong></h3>\r\n\r\n<p>MacBook Pro 2020 owns a screen with a size of 13.3 inches and a modern IPS panel. Along with that is a high resolution of 2560 x 1600 that helps images displayed on the screen with sharp quality, full depth and detail. Image colors are also faithfully reflected thanks to the IPS panel above.</p>\r\n\r\n<p>The laptop is equipped with an HD-quality Webcam for clear images and less blurred and broken focus. As a result, when you need to meet online or study online through software such as Zoom, users can rest assured to use the MacBook Pro 2020 to study or work effectively.</p>\r\n\r\n<h3><strong>Incredible performance with Apple M1 processor, equipped with 4GB RAM and large internal memory up to 512GB</strong></h3>\r\n\r\n<p>MacBook Pro 2020 achieves outstanding performance and quickly handles various tasks thanks to the new technology application chip Apple M1. This is also a chip that has been created based on modern 5-nanometer processing technology.</p>\r\n\r\n<p>The M1 also has a unified memory architecture with high bandwidth, low latency. This significantly improves usage efficiency and energy efficiency. Faster video processing speed. The game is richer and more detailed and the image processing is surprisingly fast, which enhances the user experience.</p>\r\n\r\n<p>In addition, the laptop is also equipped with a 4GB RAM for a very high bus speed of 3733MHz, helping the Macbook Pro to multitask well many tasks and minimize unwanted lag while in use. The storage of the computer is also quite impressive with a capacity of 512G</p>\r\n\r\n<p>With such a large capacity, in addition to storing unlimited important data at work, users can also download their favorite software or some games for entertainment without worrying about filling up memory too quickly.</p>\r\n\r\n<h3><strong>Equipped with Wifi 6, Bluetooth 5.0 towards extended connectivity; Thunderbolt 3 port for fast transfer speeds</strong></h3>\r\n\r\n<p>MacBook Pro 2020 has good compatibility with wireless connections when equipped with Wifi 6 and Bluetooth 5.0 standards. High Internet connection speeds allow users to access the network faster. Bluetooth 5.0 also offers more efficient data transfer speeds than previous versions.</p>\r\n\r\n<p>In addition, the laptop is also equipped with 2 Thunderbolt 3 ports with good compatibility with USB-C cables. With the Thunderbolt 3 port, the transfer speed will be 2 times faster than its predecessor Thunderbolt 2, allowing data to travel at 40Gbps with a cable length of 0.5m.</p>\r\n\r\n<p>In addition, to help the laptop protect the privacy as well as personal information of each user, Apple has also added an extremely convenient fingerprint security feature.</p>',1.400,'21.24 x 30.41 x 1.56','HD','macOS',NULL,24,'2023-03-09 07:58:21','2023-03-09 07:58:21'),(26,51,'<h2>Macbook Pro M2 - MNEQ3SA / A is a famous high-end laptop line from Apple. Not only possessing a beautiful and classy appearance, MacBook Pro M2 also leaves a deep impression with a powerful upgraded performance that improves much more than the old version, surely this is the perfect support device for you from study, work to entertainment.</h2>','<h3><strong>Trendy classy appearance, thin and light design</strong></h3>\r\n\r\n<p>MacBook Pro M2 2022 has a beautiful design that is meticulously crafted with a very solid&nbsp;<strong>monolithic metal</strong>&nbsp;shell, the back is printed with a very characteristic apple logo with extremely high brand recognition, always the focus of attracting all eyes and leaving a strong impression on those around them.</p>\r\n\r\n<p>In addition, MacBook Pro M2 also scores points with everyone when it owns a fairly thin and light design with a weight of only 1.4kg and dimensions of&nbsp;<strong>30.41 x 21.24 x 1.56cm</strong>&nbsp;giving you the ability to move flexibly easily put in a bag or backpack, carry the device with you everywhere for convenience<strong>.</strong></p>\r\n\r\n<h3><strong>Brilliant realistic Retina display, professional task handling thanks to the outstanding powerful M2 chip</strong></h3>\r\n\r\n<p>MacBook MNEQ3SA / A owns a modern&nbsp;<strong>13.3-inch</strong>&nbsp;Retina display along with a&nbsp;<strong>resolution of 2560 x 1600px</strong>&nbsp;for displaying images with vivid quality and clarity to every detail. There is also&nbsp;<strong>support for HD webcams</strong>&nbsp;so you can easily call videos with relatives and friends closely or join convenient online meetings.</p>\r\n\r\n<p>Besides, MacBook is equipped with a powerful new generation&nbsp;<strong>M2 chip</strong>&nbsp;with&nbsp;<strong>8 CPU</strong>&nbsp;cores and&nbsp;<strong>10 GPU cores</strong>&nbsp;that allow you to handle all tasks smoothly and smoothly from designing or editing images and videos on Adobe software such as Premiere, Photoshop,... are convenient and easy.</p>\r\n\r\n<h3><strong>512GB SSD standard hard drive, 8GB RAM multitasking</strong></h3>\r\n\r\n<p>MacBook Pro owns an&nbsp;<strong>SSD&nbsp;</strong>standard hard drive up to&nbsp;<strong>512GB</strong>&nbsp;to help speed up the device, access applications quickly and give you a huge storage space so you can comfortably store all information or data to study and work effectively.</p>\r\n\r\n<p>Not only that, the MacBook Pro 2022 also owns&nbsp;<strong>8GB of RAM</strong>&nbsp;memory so you can comfortably perform multi-tasking at the same time while the machine still works very smoothly, without lag in the middle, unexpected stand-up or slow response.</p>\r\n\r\n<h3><strong>Support a variety of secure connection ports, handy LED keyboard</strong></h3>\r\n\r\n<p>MacBook Pro MNEQ3SA / A is equipped with a variety of communication ports including:&nbsp;<strong>2 Thunderbolt ports</strong>&nbsp;and a headphone jack with a size of 3.5mm for you to easily connect to other peripherals as you like. Along with that is WiFi&nbsp;<strong>802.11ax (Wifi 6) and Bluetooth 5.0</strong>&nbsp;connectivity so you can connect to the internet and transfer data quickly.</p>\r\n\r\n<p>More specifically, the genuine MacBook Pro is also equipped with a handy&nbsp;<strong>LED keyboard</strong>, which supports you to easily type and limit typing wrong characters in low-light environments. The distance between keys is also very reasonable so that you can manipulate keys quickly and easily. In addition, the device is also supported with integrated&nbsp;<strong>fingerprint security</strong>, helping customers unlock faster when using.</p>\r\n\r\n<h3><strong>Equipped with a battery line with a huge duration, macOS operating system</strong></h3>\r\n\r\n<p>This MacBook Pro 2022 is also equipped with a&nbsp;<strong>battery</strong>&nbsp;line with a huge battery life of up to 20 hours so you can comfortably surf the web or play light games for a long time. In addition, when the battery runs out, you just need to plug in and wait for a few hours to be able to return to use.</p>\r\n\r\n<p>Apple has equipped the MacBook Pro 2022 with a safe and secure&nbsp;<strong>MacOS operating system</strong>&nbsp;with a very beautiful interface, very easy to use. The macOS operating system also upgrades the utility features that support you in work, study or entertainment are very interesting and great.</p>\r\n\r\n<p>&nbsp;</p>',1.400,'30.41 x 21.24 x 1.56','HD','macOS',NULL,12,'2023-03-09 08:02:23','2023-03-09 08:02:23'),(27,52,'<h2><strong>MSI launched the super product Katana 15 B13VEK to meet all the gaming needs of users.&nbsp;Produced by MSI with careful design and investment from leading components, promises a great product for game enthusiasts to fight wi