ntinuous use for hours after full charge. You can take your laptop with you to work or school without carrying a bulky charging cord.</p>\r\n\r\n<p>When buying Lenovo ThinkPad X1 Nano you will be supported to install&nbsp;<strong>Windows 11 Pro&nbsp;</strong>operating system for free. Compared to the previous generation of Windows 10, this version has many improvements. The operating system owns a more diverse application store, smoother operation with many new features such as interface customization, convenient split-screen operation,...</p>\r\n\r\n<p>&nbsp;</p>',1.000,'29.33 x 20.81 x 1.48','FHD','Windows 11',50,36,'2023-03-09 08:45:25','2023-03-09 08:45:25'),(30,55,'<p><strong>Laptop MSI Summit E14&nbsp;Evo A12M-211VN</strong>&nbsp;l&agrave;&nbsp;tuyệt t&aacute;c xuất sắc nhất đều từ&nbsp;th&agrave;nh quả&nbsp;thiết kế tinh tế v&agrave; t&iacute;nh to&aacute;n kĩ lưỡng. C&ocirc;ng nghệ kết hợp với thẩm mỹ&nbsp;đ&atilde; dung h&ograve;a phong c&aacute;ch thiết kế hậu hiện đại c&ugrave;ng với c&aacute;c c&ocirc;ng nghệ mới nhất để mang lại cảm hứng cho c&aacute;c doanh nh&acirc;n.</p>','<p><strong>Summit E14&nbsp;EVO</strong>&nbsp;trang bị bản lề 180 độ, được chứng nhận với nền tảng Intel&nbsp;Evo v&agrave; được hỗ trợ bởi bộ xử l&yacute; Intel&nbsp;Core&nbsp;i7 thế hệ 12th.&nbsp;H&atilde;y tận hưởng những trải nghiệm với&nbsp;hiệu suất cao của&nbsp;<strong>Summit E14 Evo</strong>.</p>\r\n\r\n<p><strong>Hiệu năng kh&ocirc;ng giới hạn</strong></p>\r\n\r\n<p><strong>Summit E14 EVO</strong>&nbsp;được trang bị vi xử l&iacute; Intel&nbsp;Core&nbsp;i7 thế hệ 12 mới nhất &amp; chip đồ họa Intel&nbsp;Iris&nbsp;Xe, mang lại hiệu năng hạng nặng trong một th&acirc;n m&aacute;y cực gọn nhẹ v&agrave; cơ động, sẵn s&agrave;ng gi&uacute;p bạn theo s&aacute;t c&ocirc;ng việc d&ugrave; cho đang ở bất cứ nơi đ&acirc;u.</p>\r\n\r\n<p><strong>M&agrave;n h&igrave;nh tỷ lệ v&agrave;ng</strong></p>\r\n\r\n<p><strong>Summit E14 Evo</strong>&nbsp;được thiết kế kĩ lưỡng tu&acirc;n theo Tỉ 