he luxury of the computer. In addition, the hinge of this laptop is designed extremely firmly and meticulously, can be opened and folded up to 180 degrees to help you comfortably adjust the viewing angle, optimizing all viewing angles with your needs.</p>\r\n\r\n<h3>Stable configuration on Intel Core i5-12500H, Onboard graphics chip Intel Iris Xe Graphics</h3>\r\n\r\n<p>Lenovo ThinkBook 14 supports advanced&nbsp;<strong>5th generation Intel Core i12500-12H&nbsp;</strong>processors with&nbsp;<strong>12 cores</strong>,&nbsp;<strong>16 threads</strong>&nbsp;and a clock speed of up to&nbsp;<strong>4.5GHz</strong>&nbsp;support to help your computer run smoothly with office tasks, basic graphics or comfortable entertainment on movies, even play light games.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Hiệu năng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_230024ca-2dfb-4f19-9fdf-f4b2176a7d78.png\" /></p>\r\n\r\n<p>Lenovo ThinkBook 14 owns Onboard&nbsp;<strong>Intel Iris Xe Graphics&nbsp;</strong>chip capable of<strong>&nbsp;</strong>handling all graphics tasks quite well, supporting high image quality up to 8K plus 4K HDR to help you enjoy many unique,<strong>&nbsp;</strong>attractive and extremely sharp movies.</p>\r\n\r\n<h3>Thin 14-inch screen with 90Hz refresh rate</h3>\r\n\r\n<p>Lenovo laptops have a screen of just&nbsp;<strong>14 inches</strong>&nbsp;that gives you a comfortable view that serves well in work as well as study. The screen is designed with an&nbsp;<strong>IPS</strong>&nbsp;panel and an impressive resolution of&nbsp;<strong>2880 x 1800 pixels</strong>, giving you an immersive experience on every image detail displayed perfectly, the true colors almost coincide with reality.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Màn hình\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_18595810-7492-4fae-bce0-06c3576d2755.png\" /></p>\r\n\r\n<p>Besides, the screen has a refresh rate of&nbsp;<strong>90Hz</strong>&nbsp;that makes all movements smoother and clearer than ever, thereby limiting eye strain or soreness when you have to focus on observing for a long time. In addition, Lenovo laptops also support<strong>&nbsp;FHD Webcam</strong>&nbsp;with sharp image quality that gives you a lot of convenience on online calls at work as well as study.</p>\r\n\r\n<h3>16GB Onboard RAM, 512GB SSD storage</h3>\r\n\r\n<p>Lenovo laptop has a large RAM memory of up to<strong>&nbsp;16GB</strong>&nbsp;with 2 slots, LPDDR5 standard RAM has been improved in terms of transfer speed and power consumption compared to its predecessor,&nbsp;<strong>LPDDR4</strong>, and you need to note that this<strong>&nbsp;RAM&nbsp;</strong>stick is Onboard, so it cannot be removed to upgrade.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Bộ nhớ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_c792158b-a5e6-47bd-adef-45b723fe115b.png\" /></p>\r\n\r\n<p>Lenovo laptops are supported with large storage memory up to&nbsp;<strong>512GB</strong>&nbsp;to help you store a variety of documents and files for all needs in work as well as study, and with&nbsp;<strong>SSD&nbsp;</strong>standard memory to help this laptop boot quickly and smoothly within a few short seconds.</p>\r\n\r\n<h3>Keyboard supports LEDs, optimal security</h3>\r\n\r\n<p>Lenovo has a regular keyboard design, without numeric keys but still full of basic function keys. Besides, each key has good bounce along with a monochrome&nbsp;<strong>LED</strong>&nbsp;system, significantly supporting you when typing at night or in low-light environments.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Bàn phím\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_3e97112b-f543-4a57-94e3-5b833d71ea3c.png\" /></p>\r\n\r\n<p>In addition, Lenovo Laptops not only have optimal security with one-touch&nbsp;<strong>fingerprints with</strong>&nbsp;good sensitivity, high accuracy, but also add security features&nbsp;<strong>with</strong>good recognition to bring you many conveniences when experiencing while ensuring your own privacy.</p>\r\n\r\n<h3>Sufficient battery life, diverse connection ports</h3>\r\n\r\n<p>Lenovo ThinkBook 14 has a&nbsp;<strong>62Wh</strong>&nbsp;battery that can be used just enough, comfortable in a meeting or a long study session or can even extend the duration of use throughout the day with light and basic tasks.</p>\r\n\r\n<p><img alt=\"Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Battery\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_e8dd96f2-aeb8-4ff0-8d70-30372f5fd5e5.png\" /></p>\r\n\r\n<p>In addition, Lenovo ThinkBook 14 owns a variety of ports with 1 USB&nbsp;<strong>Type C / DisplayPort / Power Delivery</strong>&nbsp;port, 2 USB 3.2 ports, 1&nbsp;<strong>USB 2.0</strong>&nbsp;port, 1&nbsp;<strong>micro SD&nbsp;</strong>card slot&nbsp;port to quickly transfer all data, 1&nbsp;<strong>Thunderbolt 4</strong>&nbsp;port connecting many devices such as mouse or keyboard,&nbsp;<strong>Audio combo</strong>&nbsp;port, 1<strong>&nbsp;HDMI</strong>&nbsp;port that outputs images in Full HD quality and<strong>&nbsp;1 GB / s LAN</strong>&nbsp;connects to the network at high speed.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 14 G4+ IAP 21CX001QVN | Cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_e6be7082-709b-4149-bfaf-ba0e10cbdc7b.png\" /></p>',1.400,'31.2 x 22.4 x 1.59','FHD','Windows 11',62,24,'2023-03-09 09:18:57','2023-03-10 13:22:40'),(39,64,'<h2>Lenovo ThinkBook 15 G2 ITL 20VE00UNVN is designed with a modern, high-end look and sturdy materials on the body. Besides, the machine has strong performance with 8GB RAM will give customers the best use experience.</h2>','<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_24be810a-7315-4490-b5fb-7a7be06a4d09.png\" /></p>\r\n\r\n<h3>Possessing a modern, new design and moderate size</h3>\r\n\r\n<p>Lenovo ThinkBook 15 is designed in a luxurious, modern direction so that when you look at it, you will feel the difference clearly. The device uses&nbsp;<strong>gray</strong>&nbsp;tones as the main color and&nbsp;<strong>ThinkBook</strong>&nbsp;letters printed on the back surface to help create a highlight for the machine, attracting the eyes of others.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Thiết kế hiện đại\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_67001ea9-ee5c-45b7-90bd-f3572f91cb1b.png\" /></p>\r\n\r\n<p>Besides, this laptop weighs&nbsp;<strong>1.7kg</strong>&nbsp;with an overall size of&nbsp;<strong>35.7x23.5x1.9cm</strong>, when placed in working positions, it will be neater and easier to use. Thanks to this compact design, the machine is easy to move as well as take out to work.</p>\r\n\r\n<h3>Large screen size, modern IPS curtain</h3>\r\n\r\n<p>The ThinkBook 15 G2 ITL has a large size with a&nbsp;<strong>15.6-inch</strong>&nbsp;screen that gives users more display space. This screen has a resolution of&nbsp;<strong>1920x1080px</strong>&nbsp;that will help the images when displayed in detail and clarity to help you have the best working, watching movie, and entertainment experience.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Màn hình sắc nét\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_39f45ced-d0af-4963-a881-16e0551804fe.png\" /></p>\r\n\r\n<p>In addition, the laptop is also equipped with the popular&nbsp;<strong>IPS</strong>&nbsp;curtain, which produces high contrast image quality as well as better reproduced colors. The device is also equipped with&nbsp;<strong>HD webcam&nbsp;</strong>for you to use video calling, online learning or join online meetings.</p>\r\n\r\n<h3>512GB storage drive with modern Intel Core CPU generation</h3>\r\n\r\n<p>ThinkBook 15 G2 ITL 20VE00UNVN is equipped by Lenovo with a capacity of up to&nbsp;<strong>512GB&nbsp;</strong>to help store work data, photos, videos more with large space.&nbsp;<strong>M.2 NVMe SSDs</strong>&nbsp;will help the machine start and open programs faster.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Hiệu năng vượt trội\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_4f2aeefa-30f8-40f2-bc37-dc5d13539513.png\" /></p>\r\n\r\n<p>This laptop is equipped with<strong>&nbsp;5MB&nbsp;</strong>1135th generation&nbsp;<strong>Intel Core i7-11G8 CPU&nbsp;</strong>with clock speed from&nbsp;<strong>2.4GHz to 4.2GHz</strong>&nbsp;and&nbsp;<strong>4 cores 8 threads</strong>&nbsp;to help the amount of data when operating will be processed quickly and efficiently with powerful operating speed as well as outstanding performance.</p>\r\n\r\n<h3>Popular graphics chip with wide range of capabilities, 8GB RAM</h3>\r\n\r\n<p>Lenovo 15 G2 ITL laptop has a graphics chip popular in high-end<strong>&nbsp;Intel Iris Xe Graphics</strong>&nbsp;models to help enjoy smoothness and sharpness. This graphics chip will help the machine consume less power and increase the duration of use as well as the quality of the screen displayed more sharply.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Chip đồ họa vượt trội\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_61b56e48-1bbc-4db2-b510-e73c19ff6196.png\" /></p>\r\n\r\n<p>The device is equipped with&nbsp;<strong>8GB Onboard</strong>&nbsp;RAM with&nbsp;<strong>DDR4</strong>&nbsp;standard and&nbsp;<strong>3200MHz</strong>&nbsp;RAM bus speed to help the machine operate stably, data traffic is transferred faster and more power saving.</p>\r\n\r\n<h3>Supports a variety of different connection ports</h3>\r\n\r\n<p>Lenovo Thinkbook 15 is supported with popular connection ports such as&nbsp;<strong>HDMI&nbsp;</strong>output port and connectors such as USB<strong>&nbsp;Type C / DisplayPort / Power Delivery port, 2 USB 3.2 ports, Thunderbolt 4 port, 1 GB / s LAN port</strong>&nbsp;to make connecting to other devices faster and more convenient.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Đa dạng cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_b549d936-57ea-4749-b6da-5153b28ebc7e.png\" /></p>\r\n\r\n<p>Lenovo Yoga<strong>&nbsp;</strong>also owns&nbsp;<strong>802.11ac WiFi</strong>&nbsp;wireless connections,&nbsp;<strong>Bluetooth 5.0</strong>&nbsp;for your convenience to connect to the Internet and mouse, keyboard, speaker ... be faster.</p>\r\n\r\n<h3>Using a 3-cell battery, the keyboard is equipped with a numeric key</h3>\r\n\r\n<p>Lenovo 15 G2 ITL uses&nbsp;<strong>a 3-cell battery</strong>&nbsp;for a longer service life, although not too buffalo, but still enough for you to use well for many hours.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Pin dung lượng lớn\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_df0b53e5-3b33-4faf-9e38-dfdc4e50d354.png\" /></p>\r\n\r\n<p><strong>Lenovo ThinkBook Yoga</strong>&nbsp;is equipped with a keyboard with very convenient&nbsp;<strong>numeric keys</strong>, and on the&nbsp;<strong>keyboard</strong>&nbsp;there is also fingerprint security to help you unlock faster as well as better data protection.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo ThinkBook 15 G2 ITL 20VE00UNVN | Bàn phím fullsize, cảm biến vân tay\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/17/20220817_897cf0ba-7e9f-4255-87df-1dc2a2e40003.png\" /></p>',1.700,'35.7 x 23.5 x 1.9','HD','Windows 11',NULL,24,'2023-03-09 09:23:43','2023-03-10 13:19:56'),(40,65,'<p>Updating</p>','<p>Updating</p>',2.400,'35.9 x 26.2 x 2.0','HD','Windows 11',80,36,'2023-03-09 09:28:01','2023-03-09 09:28:01'),(41,66,'<h2>Lenovo Legion 5 15IAH7H-82RB0047VN is one of the top choices if you want to own a laptop that can handle tasks quickly and perform graphics functions, play games smoothly. Besides, Lenovo laptops also have an eye-catching, modern appearance and powerful performance to provide a perfect user experience.</h2>','<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_ccaf2107-2828-4004-a69b-9f2322a0abf2.png\" /></p>\r\n\r\n<h3>Personality appearance with a vivid 15.6-inch screen</h3>\r\n\r\n<p>Lenovo Legion 5 15IAH7H laptop has an eye-catching, powerful appearance with square lines along with a case made of solid materials with luxurious&nbsp;<strong>and elegant gray tones</strong>. The device has dimensions of<strong>&nbsp;35.9 x 26.2 x 2.0cm&nbsp;</strong>and a weight of&nbsp;<strong>2.4kg</strong>&nbsp;you can still put in a backpack or specialized handbag to carry with you.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN |  Thiết kế mạnh mẽ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_bebb45ed-e8eb-4509-b932-7f8a7c9aa4e3.png\" /></p>\r\n\r\n<p>Lenovo computers have a&nbsp;<strong>15.6-inch&nbsp;</strong><strong>WQHD (2560 x 1440 pixels)</strong>&nbsp;screen that delivers sharp, vivid display quality combined with&nbsp;<strong>an IPS</strong>&nbsp;panel that offers a wider viewing angle. The screen has&nbsp;<strong>a 165Hz&nbsp;</strong>refresh rate for fast frame movement, giving customers a realistic, smooth entertainment and gaming experience.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN |  Màn hình sắc nét\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_3fdee7e0-07b0-40ce-b909-12a1ab918e53.png\" /></p>\r\n\r\n<p>Besides, the screen has anti-glare ability to help the image always be clearly visible even outdoors or in environments with strong light conditions. Lenovo laptops are equipped with&nbsp;<strong>FHD webcams</strong>&nbsp;to help you video call with your family, study, meet with partners online conveniently.</p>\r\n\r\n<h3>Powerful performance from 12th generation Intel Core and powerful graphics card</h3>\r\n\r\n<p>Lenovo Legion 5 laptop uses<strong>&nbsp;Intel Core i5-12500H</strong>&nbsp;processor with&nbsp;<strong>12-core structure, 16 threads,</strong>&nbsp;base clock speed of 2.5GHz and maximum clock speed of<strong>&nbsp;4.5GHz</strong>&nbsp;and<strong>&nbsp;18MB&nbsp;</strong>cache<strong>.</strong>&nbsp;This<strong>&nbsp;</strong>CPU offers powerful performance to help you handle everything from graphics to entertaining gaming smoothly.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN |  Hiệu năng, card đồ họa\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_0f419e01-b489-4b78-a9a7-413fd85ad94e.png\" /></p>\r\n\r\n<p>Along with that, Lenovo computers are equipped with&nbsp;<strong>NVIDIA GeForce RTX 3060 6GB GDDR6&nbsp;</strong>graphics cards for excellent graphics processing.&nbsp;<strong>This card will&nbsp;</strong>bring realistic, sharp image and video quality, allowing you to unleash your creativity with image editing tasks or gaming, entertainment.</p>\r\n\r\n<h3>16GB RAM for multitasking and a 512GB hard drive for comfortable storage space</h3>\r\n\r\n<p>Lenovo computers have&nbsp;<strong>16GB DDR5 RAM</strong>&nbsp;with a bus speed of&nbsp;<strong>4800MHz&nbsp;</strong>for smooth multitasking so you can handle multiple tasks at the same time easily without worrying about stuttering. In addition, this laptop also equips customers with 2 slots, supporting&nbsp;<a href=\"http://phongvu.vn/ram-laptop-scat.01-N002-01\">the upgrade of</a>&nbsp;RAM up to 32G for additional use.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN |  Bộ nhớ lưu trữ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_6dc81f15-6c80-410f-84c9-230b3f427691.png\" /></p>\r\n\r\n<p>Besides, the computer is equipped with a hard drive with a capacity of&nbsp;<strong>512GB SSD&nbsp;</strong>for you to comfortably store data, download music, download applications without worrying about full memory. This SSD also helps to speed up booting, shutting down, opening applications quickly, bringing higher work efficiency.</p>\r\n\r\n<h3>Smooth, precise keyboard with efficient cooling</h3>\r\n\r\n<p>Lenovo 82RB0048VN computer keyboard has a reasonable and spacious key spacing design to create a comfortable, smooth and accurate feeling when typing,<strong>&nbsp;with numeric keys to&nbsp;</strong>help enter data quickly and conveniently. In addition, the keyboard is equipped with beautiful&nbsp;<strong>RGB LEDs</strong>, supporting easy use in low light conditions.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN | Bàn phím\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_db260e77-8f1c-47ac-91f1-a2d300289260.png\" /></p>\r\n\r\n<p>Lenovo Legion 5 has<strong>&nbsp;its own CPU and GPU cooling system</strong>&nbsp;to help maintain working performance for a long time without overload. The base of the computer has many vents for better air flow, 70 blades are placed individually in each part for optimal cooling efficiency and noise reduction at the same time.</p>\r\n\r\n<h3><strong>Equipped with multiple physical ports and wireless connections&nbsp;</strong>&nbsp;</h3>\r\n\r\n<p>Lenovo laptops are equipped with a variety of popular connection ports such as: 1<strong>&nbsp;HDMI</strong>&nbsp;output port, 1 USB Type C / DisplayPort port, 1 USB<strong>&nbsp;Type C / DisplayPort / Power Delivery port</strong>, 3<strong>&nbsp;USB 3.2</strong>&nbsp;ports, 1&nbsp;<strong>Thunderbolt 4&nbsp;</strong>port to support connection needs, fast data transfer and<strong>&nbsp;1Gb / s LAN&nbsp;</strong>for fast internet connection, stable.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN |  Cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_a075bfe8-a23b-413d-9ba9-16abc16751ce.png\" /></p>\r\n\r\n<p>In addition to the ports, the device also has modern wireless connection ports such as:&nbsp;<strong>WiFi 802.11ax</strong>&nbsp;for easy internet connection, low latency brings high performance and<strong>&nbsp;Bluetooth 5.1</strong>&nbsp;for quick connection to peripheral devices.</p>\r\n\r\n<h3>Long usage with 4 cell 80Wh battery and pre-installed Windows 11 Home operating system</h3>\r\n\r\n<p>Legion 5 laptop is equipped with<strong>&nbsp;a 4-cell 80Wh</strong>&nbsp;battery, this battery brings long battery life so you can use it to watch movies, listen to music, play games or study, work for many hours without worrying about running out of battery midway.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN |  Pin\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_6b39884c-ad11-47e4-8884-cdd36d28eb12.png\" /></p>\r\n\r\n<p>The plus point of this Lenovo Legion 5 laptop is that it comes pre-installed with&nbsp;<strong>Windows 11 Home</strong>&nbsp;operating system to help customers save additional costs and installation time. This operating system has a more intuitive and modern interface than Windows 10 along with many smart features for higher work efficiency.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H - 82RB0048VN | Win 11\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_e29a9c55-6092-45ae-b2a8-113e1a8d7afa.png\" /></p>',2.400,'35.5 x 12.5 x 9.6','FHD','Windows 11',80,36,'2023-03-09 09:32:33','2023-03-10 13:18:55'),(42,67,'<h3><strong>Lenovo Yoga Slim 7 Carbon laptop (14ACN6) owns all the high-end elements from the inside out. Luxurious design with trendy gray color is inked by business people, light weight is only 1.1kg, so it is easy to carry. Performance delivers great experiences that boost your productivity.</strong></h3>','<p><strong>Unbelievably compact design, elegant and modern colors</strong></p>\r\n\r\n<p>Lenovo Yoga Slim 7 Carbon is launched in the Yoga laptop version, which means that the weight and dimensions of the machine are minimized for parameters only 31.3 x 21.45 x 1.49 Cm and weigh 1.1kg. This is the outstanding advantage of this model, because it is so compact, you can take it with you to work, go out, travel very comfortably.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_a1a8e975-660d-44fd-8f9d-7d7f4e94d8fe.jpg\" /></p>\r\n\r\n<p>With a touch of classy luxury, Lenovo coats this laptop with a fairly bright gray color, not opaque gray or deep gray, so it exudes all its trendy beauty. In addition, the lines of the machine are also rounded softly without angles, so it creates a pleasant feeling when watching.</p>\r\n\r\n<p><strong>&quot;ultra-thin&quot; 3-bezel screen, OLED panel with high refresh rate</strong></p>\r\n\r\n<p>The screen of this Lenovo Yoga Slim 7 Carbon laptop has a standard size of 14 inches, 2K resolution and the bezel of the machine is made as thin as possible almost without borders. The above designs will help you immerse yourself in the world of surreal, sharp images with a more vivid open view than ever.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_1501bf35-87ac-4d30-a410-d6836bc5a77c.jpg\" /></p>\r\n\r\n<p>Lenovo Yoga Slim 7 Carbon is equipped with a Retina OLED panel with a refresh rate of 90Hz, with this high refresh rate combined with a &quot;super-top&quot; OLED panel will be an effective assistant to help the image movements on the screen be expressed smoother and more rhythmically in each frame. HD Webcam is also installed above the screen border so you can easily share online videos connected to everyone.</p>\r\n\r\n<p><strong>Unexpected performance from Ryzen 7 chip, Ram handles multitasking efficiently</strong></p>\r\n\r\n<p>Lenovo Yoga Slim 7 Carbon uses AMD Ryzen 7 5800U processor with a base clock speed of 1.9 GHz and is capable of reaching an effective overclocking of 4.4 GHz, 16MB cache and 8-core, 16-thread structure that will support your computer to achieve high performance in manipulating basic tasks such as Word, Excel comes professionally such as graphic designers, montages...</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_5b696d4e-7303-416a-9dc2-e67b2fa4ac6d.jpg\" /></p>\r\n\r\n<p>The multitasking space that this laptop can give you is comfortable, smooth and fast. With 16GB of LPDDR4X Ram bus 4266MHz will manage your machine&#39;s multitasking speed thoroughly, speeding up the tab switching of launching applications or Web browsers.</p>\r\n\r\n<p><strong>Classy graphics, up to 1TB of hard drive storage</strong></p>\r\n\r\n<p>Lenovo Yoga Slim 7 Carbon carries NVIDIA GeForce MX 450 discrete card architecture and AMD Radeon Graphics processor chip will further support the graphics processing ability of this computer. From there, you can safely manipulate heavy graphics without worrying that the computer will not be able to respond.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_32f56a44-276f-4905-b9d3-0f3129992cc8.jpg\" /></p>\r\n\r\n<p>The storage capacity of this laptop is &quot;super&quot; up to 1TB in the M.2 NVMe SSD hard drive. This computer both owns a new generation hard drive with speed to read and write data or start up quickly and has a large capacity, which is a laptop product that you cannot miss.</p>\r\n\r\n<p><strong>Quiet material keyboard, 61 Wh seamless battery for long use</strong></p>\r\n\r\n<p>Looking at the keyboard range of this Lenovo laptop, the first thing that awakens our vision is that the buttons are made too sophisticated, too beautiful, although the contrast between the letters printed on the keys but with LED backlight support makes the letters embossed, so it is still enough for us to easily see and press the key correctly.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_afa42f04-fec9-4b0e-a07d-db7bbd22aec8.jpg\" /></p>\r\n\r\n<p>The battery capacity of Lenovo Yoga Slim 7 Carbon is up to 61Wh, so you can rest assured when using it, can operate continuously for about 6-8 hours to run out of battery. And the battery installed for this computer is highly durable and can support fast charging in about 2 hours.</p>\r\n\r\n<p><strong>Convenient port connection and use Windows 11 Home operating system</strong></p>\r\n\r\n<p>Lenovo Yoga Slim 7 Carbon (14ACN6) has all the connection ports including 1 USB Type C port, 2 USB Type C / DisplayPort / Data / Power Delivery ports, although there are not too many ports like other laptops, but they are capable of connecting to many devices so you can be assured of this. WiFi 802.11ax wireless connection (Wifi 6), Bluetooth 5.1 supports stronger and more stable transmission.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/29/20220329_f41b796e-0c78-4100-a353-fb36f9983cd2.jpg\" /></p>\r\n\r\n<p>No stranger to the Windows 11 Home operating system, right at its launch it knocked down a lot of techies by the many useful tools it brings. And this Lenovo laptop also has Windows 11 set up on the machine to help expand your workspace with many features and applications to support maximum work.</p>',1.100,'31.3 x 21.45 x 1.49','HD','Windows 11',61,36,'2023-03-09 09:39:06','2023-03-10 13:17:58'),(43,68,'<h2>Laptop&nbsp;LG Gram 16Z90Q is a laptop model that LG continues to launch after the success of the Gram line.&nbsp;LG laptop not only possesses an impressive ultra-thin design, but is also equipped with a powerful Intel Core i5-1240P for the ability to handle many daily tasks suitable for office users, especially successful businessmen.</h2>','<p><img alt=\"Laptop LG Gram 16Z90Q-G.AH54A5\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_0d3a4609-076e-46a6-b690-08276a4cfad1.png\" /></p>\r\n\r\n<h3>Compact design, impressive ultra-thin edges</h3>\r\n\r\n<p>LG Gram<strong>&nbsp;</strong>laptop has an extremely impressive design with a compact size of&nbsp;<strong>35.45x24.21cm</strong>, a modest thickness of&nbsp;<strong>1.68cm&nbsp;</strong>and weighs only&nbsp;<strong>1.2kg</strong>, providing the perfect look on a luxurious and trendy laptop. Therefore, this laptop is very suitable for entrepreneurs who regularly meet customers and partners.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 16Z90Q-G.AH54A5 | Mỏng nhẹ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_a8dd84cd-a70e-4287-9e38-fec5e742f3cc.png\" /></p>\r\n\r\n<p>Besides,<strong>&nbsp;</strong>Gram 2022<strong>&nbsp;</strong>has a chassis finished from magnesium-nano carbon alloy material that not only helps to protect the frame well from bumps and dents but also ensures the aesthetics and certainty of this laptop. In addition, the LG 16Z90Q laptop has 4 impressive ultra-thin edges that create a feeling of overflow along with the signature LG logo to help identify the brand well.</p>\r\n\r\n<h3>Outstanding configuration with Intel Core i5-1240P, 16GB LPDDR5 RAM</h3>\r\n\r\n<p>The LG Gram 16Z90Q is equipped with a powerful&nbsp;<strong>Intel Core i5-1240P</strong>&nbsp;CPU -&nbsp;<a href=\"https://phongvu.vn/cpu-bo-vi-xu-ly-scat.02-N003\"><strong>a CPU</strong></a>&nbsp;usually designed for high-end Ultrabook laptops. With a powerful configuration, LG laptops can handle many tasks well from basic such as surfing the web, using a lot of office software, watching movies to advanced needs.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 16Z90Q-G.AH54A5 | Hiệu năng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_c9e075c2-7fc3-44dc-b18e-a9b44d0cf29c.png\" /></p>\r\n\r\n<p>Besides, LG Gram i5 also supports large RAM up to&nbsp;<strong>16GB</strong>&nbsp;with a maximum&nbsp;<strong>RAM&nbsp;</strong>bus of&nbsp;<strong>5200MHz</strong>&nbsp;so you can comfortably run many applications smoothly, without lag.&nbsp;<strong>LPDDR5</strong>&nbsp;standard RAM optimizes power consumption and provides data transfer speeds 1.5 times faster than LPDDR4x.</p>\r\n\r\n<h3>16 inch WQXGA screen, FHD Webcam support</h3>\r\n\r\n<p>LG 16Z90Q-G. AH54A5<strong>&nbsp;</strong>owns a large&nbsp;<a href=\"https://phongvu.vn/pc-man-hinh-may-tinh-scat.03-N001\"><strong>screen</strong></a>&nbsp;up to&nbsp;<strong>16 inches</strong>&nbsp;to help you have many great experiences on a spacious display, improve visibility and bring good efficiency in your work and entertainment.</p>\r\n\r\n<p>Besides, this screen has a high resolution of&nbsp;<strong>2560x1600 pixels WQXGA</strong>, providing graphics of about 4.1 million pixels and&nbsp;<strong>an IPS</strong>&nbsp;panel for all image details, colors are displayed sharper, more realistic than ever.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 16Z90Q-G.AH54A5 | Màn hình\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_385bbe79-ee12-4ec7-aec3-f914bc4f110e.png\" /></p>\r\n\r\n<p>In addition, LG laptops are supported&nbsp;<a href=\"https://phongvu.vn/webcam-scat.04-N006\"><strong>Webcam</strong></a>&nbsp;with FHD resolution, helping you to call video with the best image quality in meetings, online exchanges or entertainment, meet with relatives, family friends through many popular applications today such as Messenger, Zalo, Zoom, Google Meet.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 16Z90Q-G.AH54A5 | Webcam\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_a5bf45c1-38d5-4fa3-a820-df726a1dc8f4.png\" /></p>\r\n\r\n<h3>Intel Iris Xe Graphics Chip, 512GB SSD storage memory</h3>\r\n\r\n<p>LG Gram 16Z90Q-G. AH54A5 is equipped with&nbsp;<strong>Intel Iris Xe Graphics</strong>&nbsp;graphics chip to give you a perfect experience with sharp, realistic image quality when you entertain on movies, even can play smoothly many games.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 16Z90Q-G.AH54A5 | Chip đồ họa\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_097e48e7-db3e-459f-87a7-bb8e6a06af77.png\" /></p>\r\n\r\n<p>Besides, Gram 2022 i5 has a large memory capacity of up to&nbsp;<strong>512GB</strong>&nbsp;so you can comfortably store a lot of data or download a lot of necessary software to serve your needs.&nbsp;<strong>SSD</strong>&nbsp;memory makes it possible for your laptop to boot faster and smoother than ever.</p>\r\n\r\n<h3>Long-term battery capacity, fullsize keyboard supports LEDs</h3>\r\n\r\n<p>On the LG Gram G.AH54A5 laptop, it is equipped with<strong>&nbsp;an 80Wh&nbsp;</strong>battery that helps you comfortably use many basic tasks throughout the day and can be used well in a presentation, meeting or study without worrying about running out of battery.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 16Z90Q-G.AH54A5 | Dung lượng pin\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_e3e7df09-8c8d-42d6-9641-ae22cb8f80c5.png\" /></p>\r\n\r\n<p>Most especially, LG Gram&#39;s keyboard is&nbsp;<strong>perfectly designed with</strong>&nbsp;deep key travel, good bounce to give you a smooth typing experience, less annoying noise. The keyboard is also supported with beautiful&nbsp;<strong>LEDs</strong>&nbsp;so you can type better in low light conditions.</p>\r\n\r\n<h3>H&ecirc;̣ đi&ecirc;̀u hành Windows 11 Home Plus, hỗ trợ đầy đủ cổng kết nối</h3>\r\n\r\n<p>LG 16Z90Q-G.AH54A5 được c&agrave;i đặt sẵn hệ điều h&agrave;nh&nbsp;<strong>Windows 11 Home Plus&nbsp;</strong>kh&ocirc;ng chỉ gi&uacute;p bạn tiết kiệm được chi ph&iacute; để c&agrave;i đặt th&ecirc;m hệ điều h&agrave;nh m&agrave; c&ograve;n cho bạn nhiều trải nghiệm giao diện hiện đại c&ugrave;ng nhiều tiện &iacute;ch độc đ&aacute;o, mới mẻ chỉ c&oacute; tr&ecirc;n Windows 11.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_e5b0af28-5ea9-4e4f-a486-8d99c30fe5c4.png\" /></p>\r\n\r\n<p>In addition,&nbsp;<a href=\"https://phongvu.vn/lg-brand.lg\"><strong>LG</strong></a><strong>&nbsp;</strong>laptops are fully supported with connection ports such as 2&nbsp;<strong>USB 3.2</strong>&nbsp;ports,&nbsp;<strong>2</strong>&nbsp;<strong>Thunderbolt 4</strong>&nbsp;ports, 1&nbsp;<strong>micro SD card slot</strong>&nbsp;port to help you connect, transfer data,<strong>&nbsp;</strong><strong>100Mbps LAN</strong>&nbsp;for fast and stable network connection and 1<strong>&nbsp;HDMI</strong>&nbsp;<strong>port</strong>&nbsp;to output images with high quality to other monitors.</p>\r\n\r\n<p>Finally, the laptop also supports&nbsp;<strong>advanced WiFi 802.11ax (Wifi 6)&nbsp;</strong>connection to help reduce latency, ensure good network connection quality and&nbsp;<strong>Bluetooth 5.1</strong>&nbsp;has a convenient and fast wireless data transfer speed.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_26caadee-7ddf-4a36-9189-ab325da450aa.png\" /></p>',1.200,'35.45 x 24.21 x 1.68','yes','Win 11',80,12,'2023-03-09 09:39:30','2023-03-10 13:15:52'),(44,69,'<h2>Lenovo Yoga 7 14ACN6 82N7002MVN is a product with a modern, compact design with a 14-inch screen and many outstanding features. Whether you are a student, student or office worker, this will still be a great choice for you.</h2>','<h3>Luxurious design with a case made of high-quality aluminum material, keys with convenient LED lights</h3>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_72a35f82-647f-4955-95ec-ffcfe7c04fbd.png\" /></p>\r\n\r\n<p><strong>Lenovo Yoga Slim 7 14ACN6-82N7008WVN laptop&nbsp;</strong>is designed with a luxurious and classy appearance that brings absolute aesthetics of the product&#39;s appearance. In addition, all parts of the laptop are finished from high-quality aluminum material and painted gray to create luxury. Besides,&nbsp;<strong>the Lenovo Yoga Slim 7</strong>&nbsp;screen is equipped with a flat glass layer to help limit unwanted scratches.</p>\r\n\r\n<p>In addition, the weight of the device is also quite serious at only&nbsp;<strong>1.5kg</strong>, an impressive volume for a high-end laptop. Compact resize with parameters&nbsp;<strong>32.04 x 21.46 x 1.77 cm</strong>&nbsp;(length x width x thickness) this makes it easy and convenient to take the Lenovo Yoga Slim 7 14ACN6-82N7008WVN<strong>&nbsp;</strong>laptop anywhere. Besides, there is also support for monochrome&nbsp;<strong>LEDs</strong>&nbsp;to help users type easily in low-light environments.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN | Thiết kế thanh lịch, nhỏ gọn\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_a56d95c5-9530-4c7b-a5e5-5423c89f4efd.png\" /></p>\r\n\r\n<h3><strong>Handle professional jobs with Ryzen 5 CPU generation, 16GB RAM, 512GB large memory capacity</strong></h3>\r\n\r\n<p>Lenovo Yoga Slim 7 14ACN6-82N7008WVN<strong>&nbsp;</strong>laptop is equipped with&nbsp;<strong>AMD Ryzen 5 5600U</strong>&nbsp;CPU, producing processor chips based on the advanced&nbsp;<strong>7nm&nbsp;</strong>FinFET TSMC process. The base clock of the Ryzen 5 5600U is set at&nbsp;<strong>2.3GHz</strong>&nbsp;to quickly handle many basic office software while ensuring smoothness and compactness. Meanwhile, with a maximum clock speed in Max Boost mode up to&nbsp;<strong>4.2GHz</strong>&nbsp;with 6 cores and 12 threads, the chip handles well with professional graphics needs.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN | Cấu hình vượt trội\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_5eeaa597-82e1-4c14-95d7-589e7fb6e6a9.png\" /></p>\r\n\r\n<p>There is also support for up to 16MB of cache and&nbsp;<strong>16GB</strong>&nbsp;of RAM&nbsp;LPDDR4X is a new generation&nbsp;<a href=\"https://phongvu.vn/ram-bo-nho-scat.02-N004\">of RAM</a>. LPDDR4X offers 30% more bandwidth but 10% more energy consumption. Through this outstanding advantage, the 4GB LPDDR8X RAM bar on&nbsp;<strong>Lenovo Yoga Slim 7</strong>&nbsp;with the highest speed of&nbsp;<strong>4266MHz</strong>&nbsp;will give users a better experience than ever.</p>\r\n\r\n<p>In addition,&nbsp;<a href=\"https://phongvu.vn/lenovo-yoga-slim-7-14acn6-82n7008wvn-xam--s220500077?sku=220500077\"><strong>Lenovo Yoga Slim 7 14ACN6-82N7008WVN</strong></a><strong>&nbsp;</strong>laptop is also equipped with a large memory of up to&nbsp;<strong>512GB</strong>&nbsp;of M2&nbsp;<a href=\"https://phongvu.vn/o-cung-ssd-scat.02-N005-01\"><strong>SSD</strong></a><strong>. PCIe</strong>&nbsp;combined with LPDDR4X RAM makes&nbsp;<strong>Yoga 7 Gen 7</strong>&nbsp;more efficient processing of applications faster.</p>\r\n\r\n<h3><strong>AMD Radeon Graphics integrated graphics card</strong></h3>\r\n\r\n<p><strong>Lenovo Yoga Slim 7 14ACN6-82N7008WVN laptop&nbsp;</strong>is equipped with<strong>&nbsp;</strong><strong>an integrated AMD Radeon Graphics</strong>card with 7 cores and a high speed of&nbsp;<strong>1800MHz&nbsp;</strong>compatible with Ryzen 5 5600U, increasing the processing performance of Yoga 7 AMD.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN | Card đồ họa tích hợp\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_90ed62aa-73bc-4e57-ad19-e48dd63d7c2f.png\" /></p>\r\n\r\n<h3><strong>14-inch screen, touch IPS, HD Webcam support</strong></h3>\r\n\r\n<p>Lenovo Yoga Slim 7 14ACN6-82N7008WVN laptop owns a&nbsp;<strong>14-inch Full HD multi-touch&nbsp;</strong>LED screen with a resolution of&nbsp;<strong>1920 x 1080</strong>&nbsp;pixels. IPS Glossy panel technology gives the screen more vibrant colors than IPS Matte panels commonly found in other laptops. When the&nbsp;<a href=\"https://phongvu.vn/pc-man-hinh-may-tinh-scat.03-N001\">screen</a>&nbsp;is folded 360 degrees, the tablet interface of&nbsp;<strong>Windows 11</strong>&nbsp;will be activated, at which point your laptop will become a true tablet.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN | Màn hình sắc nét\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_80b4e9c9-1ae5-4122-8c6d-b0fefbbce6e3.png\" /></p>\r\n\r\n<p>Besides, color coverage reaches&nbsp;<strong>72</strong>% NTSC, equivalent to&nbsp;<strong>99%</strong>&nbsp;sRGB. Meanwhile, LED technology gives light evenly throughout the areas of the screen and has a high brightness of up to&nbsp;<strong>300 nits</strong>. In addition to supporting HD Webcam convenient in studying and working, the webcam cover is also designed to allow easy opening and closing to help ensure the user&#39;s privacy.</p>\r\n\r\n<h3><strong>Design 2 vivid speakers for each sound quality, good security</strong></h3>\r\n\r\n<p><strong>Lenovo Yoga Slim 7 14ACN6-82N7008WVN laptop&nbsp;</strong>is equipped with dual&nbsp;<a href=\"https://phongvu.vn/loa-nghe-nhac-scat.06-N001\">speakers</a>&nbsp;2x2W advanced&nbsp;<strong>Dolby Audio</strong>&nbsp;technology for vivid, realistic sound so you can enjoy music, movies or even games in a better way.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN | Chất âm sống động, bảo mật tố\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_4282d7ce-8c6d-4a54-8585-081063e5a011.png\" /></p>\r\n\r\n<p>In addition, on Lenovo Yoga Slim 7 14ACN6-82N7008WVN laptop, there is a highly sensitive one-touch fingerprint sensor located in the lower right corner of the keyboard, a very optimal position because it is both easy to use and limits unnecessary collisions.</p>\r\n\r\n<h3><strong>Long-term, uninterrupted use</strong></h3>\r\n\r\n<p><strong>Lenovo Yoga Slim 7 14ACN6-82N7008WVN laptop&nbsp;</strong>owns a Lithium polymer battery with a large capacity of&nbsp;<strong>71Wh</strong>&nbsp;that allows users to use continuously for about&nbsp;<strong>15 hours</strong>&nbsp;with basic tasks without worrying about power failure. In addition, it comes with a fast charger with a capacity of&nbsp;<strong>65W</strong>&nbsp;to help users have an additional 3 hours of use with only 15 minutes of charging.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN | Dung lượng pin khủng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_f333b0b6-896f-4779-8b84-ba950dd62b2e.png\" /></p>\r\n\r\n<h3><strong>Many modern, diverse, easy-to-use connections</strong></h3>\r\n\r\n<p>Lenovo Yoga Slim 7 14ACN6-82N7008WVN<strong>&nbsp;</strong>laptop is supported with many diverse and popular connection ports today such as: 2 USB&nbsp;<strong>Type C</strong>&nbsp;/ DisplayPort / Data / Power Delivery ports, 1&nbsp;<strong>USB 3.2 port.</strong>&nbsp;There is also a wireless connection standard&nbsp;<strong>WiFi 802.11ax (Wifi 6),</strong>&nbsp;<strong>modern Bluetooth 5.0</strong>.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 14ACN6-82N7008WVN | Cổng kết nối  đa dạng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/30/20220730_96995233-31e3-4b5f-89f2-edfd72f33685.png\" /></p>',1.500,'32.04 x 21.46 x 1.568','HD','Windows 11',71,24,'2023-03-09 09:44:30','2023-03-10 13:14:59'),(45,70,'<h2><strong>Electronics company from Korea LG has never really disappointed technology lovers in terms of aesthetics in their products.&nbsp;The LG Gram 2021 17Z90P G.AH78A5 laptop&nbsp;belongs to the high-end segment, featuring a slim, light, beautiful design with a large screen up to 17 inches and super configuration.</strong></h2>','<p><strong>Slimmer design than ever</strong></p>\r\n\r\n<p><img alt=\"Laptop LG Gram 2021 17Z90P-G.AH78A5| Thiết kế mỏng hơn\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_6bfa3907-8a8e-4150-8310-8f1a31f9257f.jpg\" /></p>\r\n\r\n<p><strong>LG Laptop</strong>&nbsp;Gram 2021 17Z90P G.AH78A5 has dimensions of 38.02 x 26.01 x 1.78 cm. The thickness of the machine is at a rare low level in the laptop market today. In addition, the product is also made with a completely hidden hinge design that both increases the aesthetics of the computer and does not distract the user&#39;s concentration when using.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 2021 17Z90P-G.AH78A5| Màn hình kích thước lớn\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_9264cee8-503e-4fc2-91e9-98f4681e39de.jpg\" /></p>\r\n\r\n<p>The case is made entirely from magnesium alloy, so it has the strength needed for a shell to protect the components inside, and is superior by weight. The device weighs just over 1kg, which can completely become the computer with the largest screen but the lightest at the moment.</p>\r\n\r\n<p><strong>Traditional 16:9-inch aspect ratio design. 17-inch widescreen</strong></p>\r\n\r\n<p><img alt=\"Laptop LG Gram 2021 17Z90P-G.AH78A5| Màn hình lơn \" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_f6b60b58-0b4d-410a-b492-1b2842770216.jpg\" /></p>\r\n\r\n<p>LG Gram 2021 17Z90P G.AH78A5 is equipped with a wide screen up to 17 inches with a high-end Quad HD + (2K) resolution of up to 2560 x 1600 pixels. Along with the non-touch IPS panel integrated on the screen, LG Gram 2021 gives users more vivid and sharp images than ever. The wide viewing angle allows the viewer to look at the screen at any viewing angle without distortion.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 2021 17Z90P-G.AH78A5\\ Độ phân giải cao \" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_1eec5f62-44ae-45d9-9833-136e44bfd8bb.jpg\" /></p>\r\n\r\n<p>The 16:9 aspect ratio on LG Gram 2021 allows users to access more information without having to make too many edits to the display.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Powerful performance with high configurable suite: Core i7 CPU, 16GB RAM, 1TB SSD hard drive and Intel Iris Xe Graphics chip</strong></p>\r\n\r\n<p><a href=\"https://phongvu.vn/v\"><strong>Laptops</strong></a>&nbsp;LG Gram 2021 17Z90P G.AH78A5 integrates an Intel Core i7-1165G7 processor, clocked at 4.7 GHz, 4 cores 8 threads combined with Intel Iris Xe Graphics graphics chip. Compared to the previous generation, LG Gram 2021 17Z90P G.AH78A5 is rated to have a 20% increase in performance, content processing ability increased by nearly 3 times, users can be completely assured of the information processing speed in this product.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 2021 17Z90P-G.AH78A5| Hiệu năng manh mẽ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_372d2283-0d06-44b1-a939-cccf5dcbcddb.jpg\" /></p>\r\n\r\n<p>Using 16GB DDR4 4266MHz RAM and a hard drive with a capacity of 1TB M.2 NVMe SSD brings a large data storage space for users.</p>\r\n\r\n<p>With this configuration, users can completely use high-end applications on the LG Gram 2021 laptop, handle complex graphics tasks, watch 4K movies or play games that require high flowers smoothly and smoothly.</p>\r\n\r\n<p><strong>80Wh battery capacity comfortable to use during the day</strong></p>\r\n\r\n<p><img alt=\"Laptop LG Gram 2021 17Z90P-G.AH78A5\\ Dung lượng pin cao\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_77dd6216-9712-4392-8680-cd7ea80edb5e.jpg\" /></p>\r\n\r\n<p>LG Gram 2021 laptop 17Z90P G.AH78A5 uses a battery with a capacity of 80Wh. This battery life allows users to use it continuously for more than 19 hours after each full charge. LG Gram 2021 ensures that time is always with you to handle work or fully participate in all games.</p>\r\n\r\n<p><strong>The keyboard and hover are also scaled to accommodate large screen ratios</strong></p>\r\n\r\n<p><img alt=\"Laptop LG Gram 2021 17Z90P-G.AH78A5| Tỉ lệ cân đối \" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_039061a5-89f4-4c7c-a5ec-47499d8a0181.jpg\" /></p>\r\n\r\n<p>The touchpad area of the LG Gram 2021 17Z90P G.AH78A5 laptop is also resized wider than conventional mouse tables, to have an aspect ratio to fit the 17-inch widescreen 16: 9 ratio above.</p>\r\n\r\n<p>The keyboard used in this laptop is a regular keyboard with a key travel of about 1.6mm. The contact surface of the keys is larger so that users have a more comfortable typing feeling, minimizing spelling errors encountered when typing.</p>\r\n\r\n<p><strong>Modern gateway system</strong></p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/7/6/20220706_362f3363-446d-425b-b8d5-1c1be2188957.jpg\" /></p>\r\n\r\n<p>The difference of this product is also mentioned 2 modern Thunderbolt connectors. With Thunderbolt, data transfer speeds and security are enhanced compared to other gateways. In addition, LG Gram 2021 17Z90P G.AH78A5 has a USB 3.2 port, SD card reader slot, HDMI port.</p>\r\n\r\n<p>The device also integrates the new generation of wireless connection technology WiFi 802.11ax (Wifi 6) and Bluetooth 5.1 to bring super-fast data transmission experiences to users.</p>\r\n\r\n<p>&nbsp;</p>',1.350,'38.02 x 26.01 x 1.78','yes','Win 11',80,12,'2023-03-09 09:46:47','2023-03-10 13:13:07'),(46,71,'<h2>Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN is capable of meeting all needs from office informatics, gaming to basic graphics. With Ryzen 7 processor and beautiful graphics, the product will definitely bring users outstanding work and entertainment experiences.</h2>','<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_1be90a39-8ab5-4811-8569-2c16e31075db.png\" /></p>\r\n\r\n<h3>Compact design and sharp display quality</h3>\r\n\r\n<p>Lenovo Yoga Slim 7 ProX with the main color is gray and rounded lines to create a feeling of both minimalism and luxury. The border is made thinner for a wider viewing angle. Size&nbsp;<strong>32.82 x 22.14 x 1.59cm&nbsp;</strong>and weight only&nbsp;<strong>1.4kg</strong>, so you can easily put it in a bag or backpack to take to work or school,...</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Thiết kế cao cấp\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_478bd391-9d04-463c-aa27-4b454afdec33.png\" /></p>\r\n\r\n<p>With&nbsp;<strong>a 14.5-inch&nbsp;</strong>anti-glare screen you will have an ideal viewing angle for productive work and play. Besides, the laptop also supports&nbsp;<strong>IPS panels&nbsp;</strong>and<strong>&nbsp;3K resolution (3072 x 1920 pixels)&nbsp;</strong>to bring extremely sharp image quality as well as true and vivid colors. In particular, the refresh rate of the screen up to&nbsp;<strong>120Hz&nbsp;</strong>makes movements or operations smoother.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Màn hình\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_939c6883-ab64-4bff-ba54-2f4b25a4ab60.png\" /></p>\r\n\r\n<h3>Outstanding performance, stable graphics</h3>\r\n\r\n<p>Yoga Slim 7 ProX laptop is equipped by Lenovo with&nbsp;<strong>AMD Ryzen 7 6800HS processor (3.2GHz - 4.7GHz / 16MB / 8 cores, 16 threads).</strong>&nbsp;With outstanding performance compared to many competitors in the same segment, the computer meets a variety of needs today. Besides the basic office tasks, you can comfortably play games as well as handle basic graphics.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Hiệu năng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_d71859e6-df95-431b-b387-1a6617f2d537.png\" /></p>\r\n\r\n<p>In order to improve graphics quality, the laptop is integrated with<strong>&nbsp;RTX 3050 4GB GDDR6</strong>&nbsp;graphics card. The graphics card handles image parameters well, enhancing sharpness and more realistic colors. Besides, it also supports gaming with high fps and exporting graphics data with clear quality.</p>\r\n\r\n<h3>Smooth multitasking, comfortable storage space</h3>\r\n\r\n<p>Lenovo laptops use&nbsp;<strong>16GB of</strong>&nbsp;<strong>LPDDR5</strong>&nbsp;Onboard RAM for&nbsp;<strong>a bus speed of 6400MHz</strong>. You can use multiple software at the same time or perform many operations from basic to complex without worrying about lag or lag. As a result, it is possible to improve work productivity effectively.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Bộ nhớ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_8890c118-fa44-462c-ae95-87d77b4c0d9f.png\" /></p>\r\n\r\n<p>Yoga Slim 7 ProX gives you storage space with&nbsp;<strong>1TB of M.2 NVMe SSD.</strong>&nbsp;You can freely store your data right on your personal computer. From there, finding or organizing data will be faster and easier when using other storage platforms.</p>\r\n\r\n<h3>Diverse connection ports and convenient wireless connection</h3>\r\n\r\n<p>The laptop supports 2 x USB<strong>&nbsp;Type C / DisplayPort / Power Delivery&nbsp;</strong>ports, 2 x<strong>&nbsp;USB 3.2</strong>&nbsp;to help you connect easily to peripherals such as monitors, screens, printers,... There is also&nbsp;<strong>an additional Audio combo&nbsp;</strong>so it can connect to headphones or microphones quickly.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_85ba2ca2-e193-464b-ac41-463a5070d400.png\" /></p>\r\n\r\n<p>Laptop Lenovo Yoga Slim 7 ProX được t&iacute;ch hợp&nbsp;<strong>Bluetooth 5.1</strong>&nbsp;th&ocirc;ng minh với khả năng kết nối nhanh ch&oacute;ng với c&aacute;c thiết bị ngoại vi như tivi, chuột, tai nghe, m&aacute;y chiếu,... Ngo&agrave;i ra c&ograve;n c&oacute; th&ecirc;m kết nối&nbsp;<strong>Wifi 802.11ax (Wifi 6)&nbsp;</strong>tối ưu tốc độ mạng, mang đến trải nghiệm sử dụng Internet nhanh ch&oacute;ng hơn.&nbsp;</p>\r\n\r\n<h3>Bảo mật th&ocirc;ng minh c&ugrave;ng b&agrave;n ph&iacute;m chuẩn size c&oacute; LED</h3>\r\n\r\n<p>Một chiếc m&aacute;y t&iacute;nh x&aacute;ch tay mạnh mẽ kh&ocirc;ng chỉ dừng lại ở việc c&oacute; cấu h&igrave;nh hiện đại, t&acirc;n tiến m&agrave; c&ograve;n phải c&oacute; sự bảo mật th&ocirc;ng minh. Lenovo Yoga Slim 7 ProX tiết kiệm tối đa thời gian v&agrave; c&ocirc;ng sức đăng nhập thủ c&ocirc;ng khi đ&atilde; được t&iacute;ch hợp&nbsp;<strong>bảo mật khu&ocirc;n mặt</strong>&nbsp;ngay lập tức. Việc bảo mật th&ocirc;ng minh n&agrave;y sẽ đảm bảo sự ri&ecirc;ng tư v&agrave; bảo mật trong m&ocirc;i trường l&agrave;m việc c&ocirc;ng cộng.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Bàn phím\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_17f264f4-f28e-4227-bbd9-219034dda317.png\" /></p>\r\n\r\n<p>Lenovo Slim 7 ProX 14ARH7 82TL001AVN laptop keyboard has a&nbsp;<strong>standard size</strong>&nbsp;design with evenly arranged keys.&nbsp;<strong>LED backlight&nbsp;</strong>keyboard is installed automatically, detecting environmental light to display when needed. With this smart design, the machine both saves energy and supports users well during use.</p>\r\n\r\n<h3>70Wh battery, Windows 11 operating system</h3>\r\n\r\n<p>Lenovo has equipped this product line with&nbsp;<strong>a 4-cell 70Wh</strong>&nbsp;battery with hours of use. So you don&#39;t need to worry about running out of battery midway when you take it to school or work. With just one charge you can safely use all day with basic tasks.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Pin\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_391249be-3a50-4aec-b13b-e488d0a8180b.png\" /></p>\r\n\r\n<p>When purchasing the product, you will be supported to install&nbsp;<strong>Windows 11 Home</strong>&nbsp;for free. With this new version of the operating system, users will have a better experience with security upgrades, backup capabilities or a more diverse application store,...</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Yoga Slim 7 ProX 14ARH7 82TL001AVN | Win 11\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/11/19/20221119_732a83b4-054a-4f1a-aead-767ea58fef7f.png\" /></p>\r\n\r\n<p>&nbsp;</p>',1.400,'32.82 x 22.14 x 1.59','FHD','Windows 11',70,36,'2023-03-09 09:50:17','2023-03-10 13:12:02'),(47,72,'<h2><strong>The LG Gram 17ZD90Q-G.AX73A5</strong> laptop&nbsp;is a perfect device with an ultra-compact design, high-end display and powerful performance ready to meet all work and entertainment needs anywhere, anytime.&nbsp;Belonging to the high-end product segment, this LG laptop promises to make you satisfied with the benefits it brings.</h2>','<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_f54fb8e6-9ac0-49ac-a3cb-ca809a534ece.png\" /></p>\r\n\r\n<h3>Modern thin and light design, outstanding high-quality structural materials</h3>\r\n\r\n<p>LG Gram 17ZD90Q laptop has a striking design with an ultra-thin and light appearance. The size of the device is&nbsp;<strong>37.88x25.8 x1.77cm&nbsp;</strong>and the weight is only&nbsp;<strong>1.3kg</strong>, making it easy to hold the laptop with just one hand and put it in your backpack, the bag moves conveniently to accompany you anytime, anywhere.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | Thiết kế mỏng nhẹ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_62910743-6aac-437b-b0a4-d2033a1d1b2a.png\" /></p>\r\n\r\n<p>In addition to high mobility, LG laptops are also composed of ultra-light magnesium-nano carbon alloy materials but have very good durability, less deformation. Gram 17ZD90Q laptop has a sophisticated appearance with luxurious&nbsp;<strong>gray tones</strong>&nbsp;and square frame design lines.</p>\r\n\r\n<h3>Expand your horizons with a 17-inch display, utility anti-glare technology</h3>\r\n\r\n<p>LG has equipped its product with a high-end&nbsp;<a href=\"https://phongvu.vn/pc-man-hinh-may-tinh-scat.03-N001\"><strong>screen</strong></a>&nbsp;with a&nbsp;<strong>size of 17 inches and a</strong>&nbsp;ratio of 16: 10 for optimal display space, up to 11% larger.&nbsp;<strong>WQXGA resolution (2560 x 1600px)</strong>&nbsp;gives you an image experience with outstanding sharpness, surprisingly realistic.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | Màn hình tinh tế\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_fb1fb51d-bb1e-4f08-b600-cfbe03a7d6cd.png\" /></p>\r\n\r\n<p>The Gram 17ZD90Q laptop screen is also covered with an effective&nbsp;<strong>anti-glare layer</strong>&nbsp;with the effect of preventing the screen reflection into direct sunlight without causing unpleasant glare. This technology also helps protect the eyes so that you can use the device for a long time.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | Tấm nền chống lóa\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_b97491fe-e00f-4664-8f36-93d327a7d3f2.png\" /></p>\r\n\r\n<h3>Modern IPS panel, easy connection to FHD webcam</h3>\r\n\r\n<p>LG Gram 17ZD90Q laptop with support from modern&nbsp;<strong>IPS panels</strong>&nbsp;helps the screen have impressive brightness and high contrast. IPS also offers a wide viewing angle of up to&nbsp;<strong>178 degrees</strong>&nbsp;so you can experience high-quality images at multiple viewing angles.&nbsp;<strong>The 3% DCI-P99</strong>&nbsp;color standard makes color reproduction more realistic and vibrant with a wide color spectrum.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | IPS hiện đại\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_16da4964-6202-4550-909e-f09b821786f2.png\" /></p>\r\n\r\n<p>The screen with a thin 4-border design integrated with&nbsp;<strong>FHD&nbsp;</strong><a href=\"https://phongvu.vn/webcam-scat.04-N006\"><strong>webcam</strong></a>&nbsp;both brings high aesthetics but also helps meet the needs of working and studying online. FHD quality camera for sharp display images integrated with noise cancellation and facial recognition features enhances call quality.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | Webcam\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_cbd06ada-9414-4684-9955-e1b62a84991b.png\" /></p>\r\n\r\n<h3>Outstanding performance with Intel Core i7, 16GB RAM multitasking smoothly</h3>\r\n\r\n<p>The&nbsp;<a href=\"https://phongvu.vn/lg-brand.lg\"><strong>LG</strong></a>&nbsp;Gram 17ZD90Q laptop offers an impressive configuration when using a 12th generation&nbsp;<strong>Intel Core i7 1260P</strong>&nbsp;processor. This chip line with&nbsp;<strong>a 12-core, 16-thread structure,</strong>&nbsp;clock speed ranging&nbsp;<strong>from 2.1GHz - 4.7GHz and 18MB</strong>&nbsp;cache provides fast processing speed and&nbsp;impressive multi-tasking capabilities.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | Hiệu năng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_26c28443-6ecd-4d4e-aaa7-90a3f50c66a1.png\" /></p>\r\n\r\n<p>Besides the powerful processor, LG laptops are also equipped with<strong>&nbsp;</strong><strong>upgraded 16GB LPDDR5&nbsp;</strong><a href=\"https://phongvu.vn/ram-bo-nho-scat.02-N004\"><strong>RAM</strong></a>. This memory provides smooth simultaneous processing of tasks at the same time with speeds as high as&nbsp;<strong>5200MHz</strong>&nbsp;without causing lag affecting the experience.</p>\r\n\r\n<h3>Integrated Intel Iris Xe Graphics graphics chip, 256GB SSD standard hard drive</h3>\r\n\r\n<p>LG laptops are integrated with&nbsp;<strong>high-quality Intel Iris Xe Graphics</strong>&nbsp;graphics chips. This chip line possesses stable graphics performance that enhances the quality of the displayed image with smooth movements for new entertainment experiences. Operations such as editing images, videos are also done easily.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | Chip đồ họa\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_4591501a-a2a2-4f7c-b50f-a1d1b120d005.png\" /></p>\r\n\r\n<p>Ổ cứng<strong>&nbsp;256GB SSD M.2 NVMe</strong>&nbsp;cung cấp một kh&ocirc;ng gian lưu trữ vừa đủ để bạn c&oacute; thể tải về những h&igrave;nh ảnh, b&agrave;i nhạc y&ecirc;u th&iacute;ch hay những dữ liệu, th&ocirc;ng tin cần thiết. Ngo&agrave;i ra, ổ cứng SSD c&ograve;n gi&uacute;p n&acirc;ng cao tốc độ truy cập dữ liệu, ứng dụng v&agrave; qu&aacute; tr&igrave;nh khởi động m&aacute;y hiệu quả gi&uacute;p tiết kiệm thời gian.</p>\r\n\r\n<blockquote>\r\n<p>Xem th&ecirc;m:&nbsp;<a href=\"https://phongvu.vn/laptop-lg-gram-16z90q-g-ah54a5--s220707619?sku=220707619\"><strong>Laptop LG Gram 16Z90Q G.AH54A5</strong></a></p>\r\n</blockquote>\r\n\r\n<h3>B&agrave;n ph&iacute;m ti&ecirc;u chuẩn dễ d&agrave;ng thao t&aacute;c, dung lượng pin cực khủng</h3>\r\n\r\n<p>B&agrave;n ph&iacute;m LG Gram 17ZD90Q được thiết kế với k&iacute;ch thước hợp l&yacute;, c&aacute;c ph&iacute;m c&oacute; độ nảy tốt c&ugrave;ng h&agrave;nh tr&igrave;nh kh&aacute;c s&acirc;u mang đến trải nghiệm g&otilde; &ecirc;m &aacute;i, dễ d&agrave;ng.&nbsp;<strong>Đ&egrave;n LED hai mức độ s&aacute;ng</strong>&nbsp;được t&iacute;ch hợp gi&uacute;p bạn thoải m&aacute;i l&agrave;m việc ở cả m&ocirc;i trường thiếu s&aacute;ng. Touchpad với diện t&iacute;ch rộng r&atilde;i c&ugrave;ng độ nhạy tốt gi&uacute;p bạn dễ d&agrave;ng thao t&aacute;c một c&aacute;ch ch&iacute;nh x&aacute;c.</p>\r\n\r\n<p><img alt=\"LG Gram 17ZD90Q-G laptop. AX73A5 | Battery capacity\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_c2d749f1-6eba-459d-bcc1-f2dc739d354e.png\" /></p>\r\n\r\n<p>LG Gram 17ZD90Q laptop uses a&nbsp;<strong>battery</strong>&nbsp;with a huge capacity of&nbsp;<strong>80Wh.&nbsp;</strong>The actual duration of use is up to many hours depending on the nature of the job. With this battery, you can comfortably experience it without worrying about the battery running out quickly.</p>\r\n\r\n<h3>Diverse utility communication ports, high security</h3>\r\n\r\n<p>Despite its compact design, LG laptops are still equipped with a variety of communication ports from image output ports to connection ports such as&nbsp;<strong>USB 3.2</strong>,&nbsp;<strong>Thunderbolt 4</strong>,<strong>&nbsp;micro SD card slot</strong>,&nbsp;<strong>LAN 100Mbps</strong>&nbsp;for stable connection quality with high speed. In addition, the product has additional utility wireless connection standards such as&nbsp;<strong>WiFi 802.11ax (Wifi 6), Bluetooth 5.1.</strong></p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_67af91e0-c148-4ce6-84f1-1ea27f31d947.png\" /></p>\r\n\r\n<p>Besides, to protect the privacy of laptop users LG has added a feature to dim, lock, turn off the screen, warn in case someone is looking at the screen. What&#39;s even better is that you just need to use your eyes to adjust thanks to the face screen control feature.</p>\r\n\r\n<p><img alt=\"Laptop LG Gram 17ZD90Q-G.AX73A5 | Bảo mật cao\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/29/20220829_bd75dc12-649b-401c-b99e-e70cb5a27dc6.png\" /></p>\r\n\r\n<p>&nbsp;</p>',1.300,'37.88 x 25.88 x 1.77','yes','Win 11',80,12,'2023-03-09 09:55:29','2023-03-10 13:09:38'),(48,73,'<h2>Lenovo Legion 5 15ARH7H 82RD003TVN owns a beautiful appearance, personality and powerful performance to help handle tasks smoothly and the display is clear and smooth.</h2>','<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN\\\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_c9d9f16d-c1ee-4a82-aced-2699a9ed078e.png\" /></p>\r\n\r\n<h3>Strong, eye-catching look &ndash; 180-degree extended hinge section</h3>\r\n\r\n<p>Lenovo Legion 5 15IAH7H laptop owns a strong appearance with square lines and main&nbsp;<strong>gray tones</strong>&nbsp;to bring elegance and elegance. The device weighs&nbsp;<strong>2.4kg</strong>, is finished from durable materials and a sturdy design that you can easily carry with you.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Thiết kế\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_9f044e69-6567-4278-ba4e-a733ba21fe9d.png\" /></p>\r\n\r\n<p>Besides, the highlight of this Lenovo computer is the&nbsp;<strong>180-degree expandable</strong>&nbsp;hinge to help meet all needs. The sturdy hinge makes it easy to adjust the screen to fit the viewing angle for perfect use.</p>\r\n\r\n<h3>15.6-inch detailed display - Equipped with clear webcam FHD</h3>\r\n\r\n<p>Lenovo Legion 5 owns a&nbsp;<strong>15.6-inch&nbsp;</strong>screen with<strong>&nbsp;WQHD resolution of 2560 x 1440pixels&nbsp;</strong>and&nbsp;<strong>an IPS&nbsp;</strong>panel that provides sharp, realistic display images with<strong>&nbsp;</strong>wide viewing angles.&nbsp;<strong>165Hz</strong>&nbsp;refresh rate for smooth movements for vivid, smooth graphics, movie, gaming experience.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Màn hình\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_1dd07723-d14b-4349-8b63-0fa12681fcb7.png\" /></p>\r\n\r\n<p>Besides, a good&nbsp;<strong>anti-glare screen</strong>&nbsp;allows you to use it comfortably outdoors or in bright light conditions. Lenovo computers are also equipped with&nbsp;<strong>FHD webcams&nbsp;</strong>to help you study, meet online or video call with teammates with clear image quality.</p>\r\n\r\n<h3>Comfortable, precise keystrokes - Enhanced cooling</h3>\r\n\r\n<p>Lenovo Legion 5 computer keyboard has a reasonable layout and key spacing for a precise, comfortable typing experience, with numeric keys for convenient and fast data entry, the keyboard is also equipped with&nbsp;<strong>RGB LED</strong>&nbsp;backlighting for easy use in dark spaces. The touchpad on Lenovo Legion 5 is quite wide and skewed to the left, touch sensitive.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Bàn phím\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_9f8ac28e-08cd-4f01-afd9-afee34c42898.png\" /></p>\r\n\r\n<p>To be able to optimize working performance in time, Lenovo Legion 5 is equipped with<strong>&nbsp;its own CPU and GPU heatsink system</strong>&nbsp;so as not to overload. The base is designed with many vents for better air flow and 70 blades in each part to optimize cooling efficiency and reduce noise when operating.</p>\r\n\r\n<h3>12th Gen Intel Core for impressive performance with NVIDIA GeForce RTX 3060 6GB GDDR6 graphics card</h3>\r\n\r\n<p>Lenovo Legion 5 laptop is equipped with<strong>&nbsp;Intel Core i7-12700H</strong>&nbsp;CPU with&nbsp;<strong>14-core structure, 20 threads</strong>, base clock speed of<strong>&nbsp;2.3GHz</strong>, maximum clock speed of<strong>&nbsp;4.7GHz</strong>&nbsp;and<strong>&nbsp;24MB cache.&nbsp;</strong>This<strong>&nbsp;</strong>processor offers powerful performance to perform any task easily and quickly.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Hiệu năng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_e5b327e2-0f67-403f-8f77-22b9ab4e5a39.png\" /></p>\r\n\r\n<p>Along with that, combined with&nbsp;<strong>NVIDIA GeForce RTX 3060 6GB GDDR6&nbsp;</strong>graphics card for realistic, sharp images and videos, smooth movement, no lag for you to edit images, videos or fight hot games on the market today.</p>\r\n\r\n<h3>16GB RAM for multitasking and a 512GB hard drive for comfortable storage space</h3>\r\n\r\n<p>Owning<strong>&nbsp;16GB DDR5 RAM</strong>&nbsp;with&nbsp;<strong>a bus speed of 4800MHz</strong>&nbsp;brings the ability to multitask to run multiple tasks at the same time smoothly and smoothly without worrying about stuttering and lag. In addition, Lenovo Legion 5 is also equipped with 2 slots, supporting upgrading up to&nbsp;<strong>32GB</strong>&nbsp;<a href=\"https://phongvu.vn/ram-bo-nho-scat.02-N004\"><strong>RAM</strong></a>&nbsp;to meet more needs.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Bộ nhớ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_524d2fc2-a748-46fd-81c7-cb9b9995294a.png\" /></p>\r\n\r\n<p>Lenovo computers are equipped with&nbsp;<strong>a 512GB M.2 NVMe SSD&nbsp;</strong>hard drive for a large space to comfortably download applications, save images and videos without worrying about full memory. This SSD helps to boot the machine, shut down the machine and read and write quickly.</p>\r\n\r\n<h3><strong>Fully equipped with popular connectors and modern wireless connections&nbsp;</strong>&nbsp; &nbsp; &nbsp;</h3>\r\n\r\n<p>Lenovo Legion 5 is equipped with a variety of ports including: 1<strong>&nbsp;HDMI</strong>&nbsp;output port, 2 USB 3.2 Type C ports, 3&nbsp;<strong>USB 3.2 ports, 1 Thunderbolt 4 port, Audio&nbsp;</strong>combo to help you connect easily to other devices and transfer quickly with&nbsp;<strong>1Gb / s LAN&nbsp;</strong>for fast internet connection.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_c397dbc3-a9a2-4e05-b25e-3530c1cc13b7.png\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, m&aacute;y t&iacute;nh Lenovo c&ograve;n c&oacute; c&aacute;c cổng kết nối kh&ocirc;ng d&acirc;y như:<strong>&nbsp;Bluetooth 5.1&nbsp;</strong>gi&uacute;p kết nối kh&ocirc;ng d&acirc;y với c&aacute;c thiết bị ngoại vi kh&aacute;c dễ d&agrave;ng ở mọi nơi v&agrave;&nbsp;<strong>WiFi 802.11ax&nbsp;</strong>&nbsp;gi&uacute;p bắt Wifi mạnh mẽ, kết nối ổn định với độ trễ thấp.&nbsp;</p>\r\n\r\n<h3>Vi&ecirc;n pin 4 cell 80 Wh cho thời lượng sử dụng tốt - C&agrave;i đặt sẵn hệ điều h&agrave;nh Windows 11 Home SL&nbsp;</h3>\r\n\r\n<p>Laptop Legion 5 sở hữu vi&ecirc;n pin liền<strong>&nbsp;4 cell 80 Wh</strong>&nbsp;cho bạn thời lượng pin d&agrave;i để thoải m&aacute;i sử dụng học tập, l&agrave;m việc hay chơi game, xem phim, nghe nhạc li&ecirc;n tục nhiều giờ đồng hồ m&agrave; kh&ocirc;ng lo hết pin.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Pin \" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_56d80f07-6f7c-4617-bfca-917afbe3b7de.png\" /></p>\r\n\r\n<p>Pre-installed&nbsp;<strong>Windows 11 Home SL</strong>&nbsp;operating system helps customers not need to spend money installing when buying Lenovo Legion 5 laptop. This operating system has many smart features and a modern interface for higher work efficiency than the previous Windows 10 operating system.</p>\r\n\r\n<p><img alt=\"Laptop Lenovo Legion 5 15IAH7H-82RB0047VN | Win 11\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_6a17ff94-c259-4f57-b185-ccba7ada9e5e.png\" /></p>',2.400,'35.88 x 26.235 x 1.999','FHD','Windows 11',80,36,'2023-03-09 10:00:00','2023-03-10 13:08:42'),(49,74,'<h2><strong>LG Gram 2021 14Z90P G.AH75A5 laptop has a modern, compact design, luxurious colors, powerful configuration, large storage capacity, responsive keyboard, high security features.&nbsp;The product is suitable for those who have graphic design needs, using high configuration.</strong></h2>','<h3><strong>Slim design, modern style, luxurious colors</strong></h3>\r\n\r\n<p>LG Gram 2021 14Z90P G.AH75A5 laptop has a compact design, with an ultra-light weight of only 1kg, dimensions of 31.34 cm x 21.52cm (length x width), ultra-thin with a thickness of only 1.68 cm. You can easily take your laptop to school to work, or business trips easily and conveniently.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/7/21/20210721_5aba5fa0-bf02-4f07-a241-86925cd3ee55.jpg\" /></p>\r\n\r\n<p>The luxurious color, modern design of LG Gram 2021 14Z90P G.AH75A5 attracts all eyes, each corner is delicately designed, using good materials.</p>\r\n\r\n<h3><strong>High resolution 14-inch screen, HD webcam, Intel Iris Xe Graphics chip</strong></h3>\r\n\r\n<p>You can experience sharp true images with the 14-inch IPS screen, 1920 x 1200 pixel resolution of the LG Gram 2021 14Z90P G.AH75A5 laptop. Thanks to that, you will have designs for accurate and vivid colors.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/7/21/20210721_d0fefd32-dffc-4611-9f1a-07666187b422.jpg\" /></p>\r\n\r\n<p>Ng&agrave;y nay, nhu cầu học tập trực tuyến online diễn ra phổ biến hơn bao giờ hết. Nhờ c&oacute; webcam HD của laptop LG Gram 2021 14Z90P G.AH75A5 bạn c&oacute; thể gọi điện hay tham dự c&aacute;c cuộc học tập, hội họp trực tuyến với những khung h&igrave;nh sắc n&eacute;t.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/7/21/20210721_b7d430d6-aeab-4ced-8178-d49530459a98.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, laptop LG Gram 2021 14Z90P G.AH75A5 c&ograve;n trang bị chip đồ họa Intel Iris Xe Graphics gi&uacute;p bạn thực hiện những thao t&aacute;c thiết kế đồ họa, hay trải nghiệm những tựa game online một c&aacute;ch mượt m&agrave;.</p>\r\n\r\n<h3><strong>Cấu h&igrave;nh mạnh mẽ core i7, RAM 16GB thế hệ DDR4, ổ cứng 512GB SSD M.2 NVME</strong></h3>\r\n\r\n<p>Mặc d&ugrave; c&oacute; vẻ ngo&agrave;i mỏng nhẹ nhưng laptop LG Gram 2021 14Z90P G.AH75A5 c&oacute; cấu h&igrave;nh mạnh mẽ, core i7 intel core thế hệ thứ 11, bạn c&oacute; thể thực hiện c&aacute;c t&aacute;c vụ thiết kế, sử dụng c&aacute;c ứng dụng phần mềm đồ họa một c&aacute;ch mượt m&agrave;.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/7/21/20210721_816bb4d8-c047-423d-ac5a-3225df3a433b.jpg\" /></p>\r\n\r\n<p>Laptop LG Gram 2021 14Z90P G.AH75A5 c&oacute; Ram 16GB thuộc thế hệ DDR4 đọc v&agrave; ghi nhớ dữ liệu một c&aacute;ch nhanh ch&oacute;ng. Ổ cứng SSD 512 GB M.2 NVME gi&uacute;p bạn khởi động m&aacute;y, mở c&aacute;c ứng dụng một c&aacute;ch nhanh ch&oacute;ng, dung lượng lớn gi&uacute;p bạn lưu trữ được nhiều t&agrave;i liệu.</p>\r\n\r\n<h3><strong>T&iacute;ch hợp đa kết nối v&agrave; kết nối chuẩn kh&ocirc;ng d&acirc;y</strong></h3>\r\n\r\n<p>Đặc biệt, laptop LG Gram 2021 14Z90P G.AH75A5 t&iacute;ch hợp đa cổng kết nối 1 cổng xuất h&igrave;nh ảnh chuẩn HDMI, 2 cổng USB 3,2, 2 thunderbolt, 1 micro SD card slot, gi&uacute;p laptop dễ d&agrave;ng kết nối với c&aacute;c thiết bị ngoại vi.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/7/21/20210721_14652d61-85e6-4efa-983d-d4ef6275c9df.jpg\" /></p>\r\n\r\n<p>Ngo&agrave;i ra, laptop LG Gram 2021 14Z90P G.AH75A5 c&ograve;n trang bị kết nối chuẩn kh&ocirc;ng d&acirc;y wifi 802.11ax (wifi 6), Bluetooth 5.1, gi&uacute;p bạn kết nối internet phục vụ c&ocirc;ng việc, học tập, kh&ocirc;ng bị gi&aacute;n đoạn.</p>\r\n\r\n<h3><strong>B&agrave;n ph&iacute;m nhạy b&eacute;n, pin liền 72 Wh t&iacute;nh năng bảo mật cao</strong></h3>\r\n\r\n<p>The keyboard of LG Gram 2021 14Z90P G.AH75A5 is designed simply, the groups of keys are streamlined, easy for users, sensitive keys, anti-blur due to hand sweat or typing force.</p>\r\n\r\n<p><img src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2021/7/21/20210721_1243d62a-7a0a-4f8f-85e4-8cb546befa2c.jpg\" /></p>\r\n\r\n<p>Instead of entering passwords like normal laptop product lines, easy to crack, LG Gram 2021 14Z90P G.AH75A5 is equipped with fingerprint security, helping your stored information to be safe.</p>\r\n\r\n<p>In addition, LG Gram 2021 14Z90P G.AH75A5 uses a 72 Wh battery, which can be used continuously for many hours, fast recharge time.</p>\r\n\r\n<p>&nbsp;</p>',1.000,'31.34 x 21.52 x 1.68 cm','yes','Win 11',80,12,'2023-03-09 10:34:09','2023-03-10 13:07:28'),(50,75,'<h3><strong>Asus Vivobook X515EA-BQ2351W laptop is one of the most popular laptops for many students. With a low price, this laptop is quickly sought after with a modern design and stable performance, giving you an enjoyable experience.</strong></h3>','<p><strong>Elegant, compact design that is easy to carry</strong></p>\r\n\r\n<p>Asus Vivobook laptop has an extremely eye-catching appearance with a compact, elegant design, the screen is designed with ultra-thin bezels and gray color exudes a powerful and modern look. The screen border is still a familiar black color and the ASUS logo creates an accent.</p>\r\n\r\n<p><img alt=\"Asus Vivobook X515EA-BQ2351W | Clean design\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/14/20220314_051dfd2e-8a66-4630-9728-952529e41383.jpg\" /></p>\r\n\r\n<p>Even more impressive is that this ASUS VivoBook X515EA has dimensions of 36 x 23.5 x 1.99 cm and weighs only 1.8kg, very light even though this is only a 15.6-inch laptop. Above the screen is also equipped with a VGA webcam convenient for online learning, online meetings of users.</p>\r\n\r\n<p><strong>Sharp 15.6-inch Full HD screen, equipped with IPS panel</strong></p>\r\n\r\n<p>Asus X515EA-BQ2351W laptop is equipped with a 15.6-inch screen with a resolution of 1920 x 1080 pixels (Full HD). The IPS panel of this computer also gives the ability to display images sharper than normal monitors with a wide color range, reducing blue light, enhancing details in all lighting conditions.</p>\r\n\r\n<p><img alt=\"Asus Vivobook X515EA-BQ2351W | 15.6-inch screen\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/14/20220314_86e4d140-54d8-4fd6-b5b9-02def6aee434.jpg\" /></p>\r\n\r\n<p>In addition, this laptop also owns an anti-glare screen that prevents the screen from glare, mirrors even in harsh lighting conditions. Along with that, this screen also helps users avoid eye strain when used for a long time, suitable for office workers or students who have to use the machine regularly.</p>\r\n\r\n<p><strong>Stable performance, Intel Core i3-1115G4 for all smooth tasks</strong></p>\r\n\r\n<p>Asus Vivobook X515EA-BQ2351W has an ideal configuration for office work when the power of the machine comes not only from the Intel core i3-1115G4 processor (3.0 GHz - 4.10 GHz / 6MB / 2 cores, 4 threads) but also from 1 x 4GB Onboard DDR4 RAM (1 slot) for high performance.</p>\r\n\r\n<p><img alt=\"Asus Vivobook X515EA-BQ2351W | Powerful performance\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/14/20220314_51218c7d-8fcf-4db8-91ce-e2ea2d0ac8ae.jpg\" /></p>\r\n\r\n<p>This chip saves battery life when manufactured on the advanced 10nm SuperFin process. Meanwhile, 4GB DDR4 RAM on board also helps users operate the machine smoother and smoother.</p>\r\n\r\n<p><strong>Equipped with Intel UHD Graphics chip and 512GB SSD hard drive</strong></p>\r\n\r\n<p>In addition, Vivobook X515EA owns Intel UHD Graphics chip that also helps you perform basic office tasks, or browse the web, entertainment, watch movies, office basics more smoothly.</p>\r\n\r\n<p><img alt=\"Asus Vivobook X515EA-BQ2351W | High storage capacity\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/14/20220314_7289ad5f-a4ac-4e24-8cb7-a2b2a504e9e1.jpg\" /></p>\r\n\r\n<p>Th&ecirc;m v&agrave;o đ&oacute;, laptop Asus Vivobook n&agrave;y c&ograve;n c&oacute; sẵn ổ cứng 512GB SSD M.2 NVMe, vừa cho dung lượng lưu trữ lớn, vừa c&oacute; thể&nbsp; tăng tốc to&agrave;n diện m&aacute;y t&iacute;nh. Ổ cứng n&agrave;y kết hợp với bộ nhớ RAM của m&aacute;y, cho bạn một kh&ocirc;ng gian vừa đủ cho việc lưu trữ t&agrave;i liệu, h&igrave;nh ảnh, video dễ d&agrave;ng.</p>\r\n\r\n<p><strong>Hỗ trợ đầy đủ kết nối, hệ điều h&agrave;nh Windows 11 Home</strong></p>\r\n\r\n<p>Chiếc laptop Asus cũng hỗ trợ đầy đủ những kết nối phổ biến như: 1 cổng USB 3.2 Type C, 1 cổng USB 3.2 , 2 cổng USB 2.0, 1 cổng HDMI. Nhờ đầy đủ cổng kết nối tr&ecirc;n m&aacute;y t&iacute;nh n&agrave;y c&oacute; thể kết nối với mọi thiết bị ngoại vi để phục vụ tối ưu cho c&ocirc;ng việc của bạn.&nbsp;</p>\r\n\r\n<p><img alt=\"Laptop Asus Vivobook X515EA-BQ2351W | Đa dạng cổng kết nối\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/14/20220314_6839c0d9-2a49-4df6-8809-2008858215ac.jpg\" /></p>\r\n\r\n<p>ASUS đ&atilde; trang bị cho chiếc laptop Vivobook X515EA-BQ2351W hệ điều h&agrave;nh Windows 11 Home, cho ph&eacute;p bạn được trải nghiệm phi&ecirc;n bản Windows bản quyền trọn vẹn m&agrave; kh&ocirc;ng lo mất ph&iacute;. Win 11 với những cải tiến về giao diện v&agrave; được n&acirc;ng cao bảo mật,&nbsp; gi&uacute;p tối ưu được hiệu suất c&ocirc;ng việc của người d&ugrave;ng.</p>\r\n\r\n<p><strong>Trang bị cảm biến v&acirc;n tay, Pin 2 cell 37Wh</strong></p>\r\n\r\n<p>Laptop Asus X515EA-BQ2351W được trang bị cảm biến v&acirc;n tay t&iacute;ch hợp ngay trong touchpad của m&aacute;y t&iacute;nh cho ph&eacute;p người d&ugrave;ng chỉ mất đ&uacute;ng một c&uacute; chạm để mọi thứ được sẵn s&agrave;ng. Việc bảo mật bằng v&acirc;n tay c&oacute; thể gi&uacute;p bảo mật laptop của m&igrave;nh tốt hơn, mở app hay thanh to&aacute;n online được thuận tiện hơn.</p>\r\n\r\n<p><img alt=\"Asus Vivobook X515EA-BQ2351W | High battery capacity\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/3/14/20220314_9d625d6b-04b5-4a85-9ab7-d8bcdcc7b549.jpg\" /></p>\r\n\r\n<p>Asus has equipped this laptop with a 2-cell 37Wh battery, allowing users just enough time to experience entertainment or work without worrying too much about their laptop running out of battery midway.</p>',1.800,'36 x 23.5 x 1.99','VGA','Windows 11',37,24,'2023-03-10 12:35:37','2023-03-10 13:03:42'),(51,76,'<h2>Asus Vivobook X1502ZA-BQ127W is a high-end laptop model of the Vivobook series from the Asus brand that is not too strange to users. Owning a fairly simple and compact design that catches up with the trend and outstanding performance in the price range promises to satisfy office workers or students.</h2>','<p><img alt=\"Laptop ASUS Vivobook X1502ZA-BQ127W\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/20/20220820_3c1c26b7-a932-4aa7-a6aa-82c13e5363aa.png\" /></p>\r\n\r\n<h3><strong>The design has a simple and convenient style</strong></h3>\r\n\r\n<p>Asus Vivobook laptop owns a compact design with dimensions of&nbsp;<strong>35.97x23.25x1.99cm</strong>, combined with&nbsp;<strong>youthful</strong>&nbsp;<strong>blue colors</strong>&nbsp;to bring unique freshness. Along with that, Asus laptops have&nbsp;<strong>an ultra-light</strong>&nbsp;weight of only about&nbsp;<strong>1.7kg</strong>, allowing users to easily carry them with them to suit people who move a lot.</p>\r\n\r\n<p><img alt=\"Laptop ASUS Vivobook X1502ZA-BQ127W | Thiết kế nhỏ gọn\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/20/20220820_a18e11ad-1969-44af-9662-5c6f2f6840b4.png\" /></p>\r\n\r\n<h3>Full HD standard screen clearly displays images, thin screen bezels balance to create a wide viewing angle</h3>\r\n\r\n<p>Vivobook is equipped with&nbsp;<strong>a 15.6-inch Full HD IPS</strong>&nbsp;panel for clear display image quality, true colors with high detail. With this screen, it can meet the needs of the vast majority of users in terms of work and entertainment needs.</p>\r\n\r\n<h3>Full HD standard screen clearly displays images, thin screen bezels balance to create a wide viewing angle</h3>\r\n\r\n<p>Vivobook is equipped with&nbsp;<strong>a 15.6-inch Full HD IPS</strong>&nbsp;panel for clear display image quality, true colors with high detail. With this screen, it can meet the needs of the vast majority of users in terms of work and entertainment needs.</p>\r\n\r\n<p><img alt=\"Laptop ASUS Vivobook X1502ZA-BQ127W | Màn hình sắc nét\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/20/20220820_9f628023-95cc-47ed-be9a-8865d432a182.png\" /></p>\r\n\r\n<p>Asus Vivobook X1502ZA laptop owns thin screen bezels that are evenly balanced on both sides, combined with squarely designed screen corners to make the overall laptop perfect. This laptop has&nbsp;<strong>a thin screen border</strong>, helping to create a wider view from many sides.</p>\r\n\r\n<h3>Powerful configuration by new generation Intel Core i5-1240P, integrated Intel Iris Xe Graphics chip</h3>\r\n\r\n<p>Vivobook is equipped with an outstanding powerful configuration thanks to the 5th generation&nbsp;<strong>Intel Core i1240-12P</strong>&nbsp;CPU. With&nbsp;<strong>12 cores of 16 threads</strong>, the 12MB cache for a powerful clock speed of up to&nbsp;<strong>4.4GHz</strong>&nbsp;allows users to comfortably manipulate smooth office tasks or use image editing software at a basic level.</p>\r\n\r\n<p><img alt=\"Laptop ASUS Vivobook X1502ZA-BQ127W | Cấu hình mạnh mẽ\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/20/20220820_9dbd540a-85c6-450d-8533-9c3945e8b56c.png\" /></p>\r\n\r\n<p>In addition, the Asus Vivobook laptop also integrates<strong>&nbsp;an Intel Iris Xe Graphics</strong>&nbsp;graphics chip, which helps to optimize the display image quality but still ensures stability and power saving. Users can freely enjoy the thrilling footage.</p>\r\n\r\n<h3>Comfortable storage with 512GB M.2 NVMe standard SSD, smooth multitasking thanks to 8GB RAM with upgrade support</h3>\r\n\r\n<p>Asus Vivobook laptop meets the storage needs of users by being equipped with a ROM capacity of up to<strong>&nbsp;512GB</strong>&nbsp;of M.2 NVMe&nbsp;<strong>standard SSD</strong>. Users will not need to worry much about memory overflow when using this laptop, SSD standard also helps to start up the machine even faster.</p>\r\n\r\n<p><img alt=\"Laptop ASUS Vivobook X1502ZA-BQ127W | Bộ lưu trữ lớn\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/20/20220820_9e62a705-321b-4d8d-838c-bd96b282883f.png\" /></p>\r\n\r\n<p>Not only that, the Asus Vivobook laptop allows users to multitask smoothly at the same time without worrying about lag thanks to the<strong>&nbsp;8GB RAM</strong>&nbsp;equipped on the device. You can also upgrade up to&nbsp;<strong>20GB</strong>&nbsp;of RAM as soon as you buy it.</p>\r\n\r\n<h3>Supports Windows 11 Home preinstallation, 3 cell 42 Wh battery and full-size keyboard</h3>\r\n\r\n<p>Vivobook X1502ZA comes pre-installed with&nbsp;<strong>Windows 11 Home</strong>&nbsp;operating system, which makes it possible for users to use immediately without having to spend any extra fees. Besides, you can also experience new gadgets on laptops soon.</p>\r\n\r\n<p><img alt=\"Laptop ASUS Vivobook X1502ZA-BQ127W | Dung lượng pin lớn, bàn phím full size\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/20/20220820_1ed93e02-a6d0-4cee-ba98-a39b0374f7e5.png\" /></p>\r\n\r\n<p>In addition, the Asus Vivobook laptop uses&nbsp;<strong>a 3-cell 42Wh</strong>&nbsp;battery for up to 8 hours of basic tasks but only takes about 2 hours to fully charge. You can use your laptop for about one session without having to plug it in.</p>\r\n\r\n<p>M&aacute;y t&iacute;nh x&aacute;ch tay Vivobook c&ograve;n được nh&agrave; sản xuất trang bị b&agrave;n ph&iacute;m&nbsp;<strong>full size</strong>&nbsp;cực kỳ tiện lợi. Với c&aacute;c ph&iacute;m bấm được gia c&ocirc;ng tinh xảo được bố tr&iacute; một c&aacute;ch hợp l&yacute;, h&agrave;nh tr&igrave;nh ph&iacute;m s&acirc;u kết hợp với&nbsp;<strong>touchpad bố tr&iacute; hợp l&yacute;</strong>&nbsp;sẽ gi&uacute;p người d&ugrave;ng thuận tiện trong qu&aacute; tr&igrave;nh nhập liệu hoặc g&otilde; văn bản, ph&ugrave; hợp cho những người l&agrave;m văn ph&ograve;ng.</p>\r\n\r\n<h3>Đầy đủ chuẩn kết nối vật l&yacute; tiện lợi, chuẩn kết nối kh&ocirc;ng d&acirc;y hiện đại nhanh ch&oacute;ng</h3>\r\n\r\n<p>Asus Vivobook laptop is fully integrated with popular physical connection ports today including&nbsp;<strong>HDMI</strong>&nbsp;output port, 1 USB 3.2&nbsp;<strong>Type C port, 2 USB 3.2 ports.</strong>&nbsp;With this amount of ports, you can conveniently connect to other peripherals.</p>\r\n\r\n<p><img alt=\"Laptop ASUS Vivobook X1502ZA-BQ127W | Cổng kết nối đa dạng\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/8/20/20220820_4fc06903-ae35-42d0-b85a-1dc17eeaff37.png\" /></p>\r\n\r\n<p>Not only that, Asus Vivobook laptop also has other modern wireless connection standards such as&nbsp;<strong>WiFi 802.11ax</strong>&nbsp;(Wifi 6),&nbsp;<strong>Bluetooth 5.0.</strong>&nbsp;Allows users to connect wirelessly conveniently and quickly, limiting unwanted interruptions when using.</p>',1.700,'35.97 x 23.25 x 1.99','HD','Windows 11',42,24,'2023-03-10 12:43:26','2023-03-10 12:43:26'),(52,77,'<h2>Asus Vivobook A1503ZA-L1421W is a great option in the 20 million price range for those who are looking for a device with a finished design. Asus Vivobook owns a thin and light appearance besides impressive performance parameters that give users new experiences.</h2>','<p><img alt=\"Laptop Asus Vivobook A1503ZA-L1421W\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_a9bc5961-0814-48b1-97c8-61dc2b188ea7.png\" /></p>\r\n\r\n<h3>Exquisite design with thin and light size, luxurious colors</h3>\r\n\r\n<p>Asus Vivobook will impress you at first sight by its design with delicate square lines. You can easily open and close the machine quickly thanks to the sturdy but equally flexible hinge. The weight of only&nbsp;<strong>1.7kg</strong>&nbsp;and compact size make it easy to carry anywhere.</p>\r\n\r\n<p><img alt=\"Asus Vivobook A1503ZA-L1421W | Luxurious silver paint\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_64928fa7-b57f-430f-a185-d5b8c66a1837.png\" /></p>\r\n\r\n<p><a href=\"https://phongvu.vn/c/laptop-asus\">Asus laptops</a>&nbsp;wear a luxurious&nbsp;<strong>silver paint</strong>&nbsp;and high-quality materials, limiting dirt and fingerprints. The Asus Vivobook logo is meticulously sculpted and stylized, creating a signature brand that is easy for users to recognize.</p>\r\n\r\n<h3>Outstanding configuration with Intel Core i5, impressive graphics processing ability</h3>\r\n\r\n<p>Equipped with a powerful<strong>&nbsp;5th generation Intel Core i12500-12H</strong>&nbsp;processor, the Asus Vivobook A1503ZA laptop quickly handles all tasks from simple to complex. Composed of&nbsp;<strong>12 cores, 16 threads</strong>&nbsp;for a maximum clock fluctuation of up to&nbsp;<strong>4.5GHz</strong>&nbsp;and&nbsp;<strong>18MB</strong>&nbsp;cache to improve operational productivity for optimal working efficiency.</p>\r\n\r\n<p><img alt=\"Asus Vivobook A1503ZA-L1421W | Performance, graphics chip\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_5349aae5-b41f-4fa8-b554-726bf9baaf4f.png\" /></p>\r\n\r\n<p>In addition, the device also supports integrated&nbsp;<strong>Intel UHD Graphics</strong>&nbsp;graphics chip for impressive graphics processing ability. From there you can easily perform graphic jobs such as editing photos, videos,... from basic to complex right on Asus laptops.</p>\r\n\r\n<h3>15.6-inch screen displays sharp, HD webcam easily connects anywhere</h3>\r\n\r\n<p>Vivobook computer is equipped with a large screen up to&nbsp;<strong>15.6 inches&nbsp;</strong>with a thin bezel design for spacious display space.&nbsp;<strong>Full HD&nbsp;</strong>resolution helps deliver sharp, vivid frames that satisfy your experience.&nbsp;<strong>OLED</strong>&nbsp;panels help improve the quality of the displayed image thanks to high contrast, significantly expanding the viewing angle.</p>\r\n\r\n<p><img alt=\"Asus Vivobook A1503ZA-L1421W | Monitor\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_3e0e5bb6-4f33-48d0-a9c2-e5f674ce1a97.png\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Asus laptops make it easy to connect thanks to a webcam with sharp HD display quality. From there you can call online learning and working videos conveniently anywhere.&nbsp;<strong>The mirror screen</strong>&nbsp;not only enhances the aesthetics but also helps to reproduce colors brilliantly, but it will be uncomfortable if hit by direct light.</p>\r\n\r\n<h3>Full-size keyboard for easy input, smooth touchpad with integrated fingerprint security</h3>\r\n\r\n<p>The keyboard of Vivobook laptop is designed full&nbsp;<strong>size</strong>&nbsp;full of numeric keys to help you easily enter data quickly. The keys are streamlined, the smooth key design provides a comfortable experience. Monochrome&nbsp;<strong>LED luminaires</strong>&nbsp;are equipped to help you operate more accurately even in low-light environments.</p>\r\n\r\n<p><img alt=\"Asus Vivobook A1503ZA-L1421W | Keyboard\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_5e5ea14c-c408-47f0-9abe-bb041e870c32.png\" /></p>\r\n\r\n<p>The touchpad and large hand rest are both easy to control and have a comfortable hand rest space. Moreover, the touchpad is also integrated with&nbsp;<strong>a fingerprint sensor</strong>&nbsp;that provides high security, you can also easily open the device with just one touch.</p>\r\n\r\n<h3>Ample 512GB storage space, 8GB Onboard RAM</h3>\r\n\r\n<p>Asus Vivobook laptop uses memory with a capacity of&nbsp;<strong>512GB</strong>&nbsp;with the ability to give you large storage space. SSDs make it possible to access information, data and boot machines in seconds.</p>\r\n\r\n<p><img alt=\"Asus Vivobook A1503ZA-L1421W | Memory\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_31a67c5b-7e03-4e2a-bcaf-5e70d56b97c4.png\" /></p>\r\n\r\n<p>Asus Vivobook offers smooth multitasking thanks to<strong>&nbsp;8GB Onboard DDR4 RAM&nbsp;</strong>that makes it easy to handle tasks simultaneously without interruptions and lag. In addition, the device is also supported up to&nbsp;<strong>16GB&nbsp;</strong>to help you easily expand more space to improve working efficiency.</p>\r\n\r\n<h3>Long-term battery capacity, preinstalled Windows 11 Home operating system</h3>\r\n\r\n<p>Asus has equipped its products with a battery with a capacity of&nbsp;<strong>3 cells 70 Wh</strong>. The seamless battery design both extends the life of the device and reduces the size of the device. With this battery you can comfortably study and work for many hours and charge the battery quickly thanks to modern charging technology.</p>\r\n\r\n<p><img alt=\"Asus Vivobook A1503ZA-L1421W | Battery\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_7204e315-aa0d-40a1-bb1e-a3c92149ef68.png\" /></p>\r\n\r\n<p>Laptop Asus được c&agrave;i đặt sẵn hệ đi&ecirc;̀u hành&nbsp;<strong>Windows 11 Home</strong>. Được biết đ&acirc;y l&agrave; hệ điều h&agrave;nh mới với khả năng cung cấp nhiều tiện &iacute;ch th&ocirc;ng minh v&agrave; kho ứng dụng miễn ph&iacute; rộng lớn lu&ocirc;n sẵn s&agrave;ng phục vụ bạn. Khi sở hữu m&aacute;y bạn cũng kh&ocirc;ng cần tốn th&ecirc;m bất kỳ chi ph&iacute; lắp đặt hay mua bản quyền m&agrave; c&oacute; thể sử dụng trực tiếp.</p>\r\n\r\n<p><img alt=\"Laptop Asus Vivobook A1503ZA-L1421W | Win 11\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_0074e766-e2a9-4239-bd51-75553616bca5.png\" /></p>\r\n\r\n<h3>Trang bị đa dạng c&aacute;c cổng giao tiếp, kết nối kh&ocirc;ng d&acirc;y nhanh ch&oacute;ng, hiện đại</h3>\r\n\r\n<p>Laptop Vivobook được trang bị đầy đủ c&aacute;c cổng tiện &iacute;ch ở hai b&ecirc;n h&ocirc;ng m&aacute;y gồm c&oacute; cổng xuất h&igrave;nh&nbsp;<strong>HDMI</strong>, cổng kết nối&nbsp;<strong>USB 3.2 Type C</strong>,&nbsp;<strong>USB 3.2, USB 2.0</strong>&nbsp;với tốc độ truyền dữ liệu cao m&agrave; kh&ocirc;ng cần th&ecirc;m nhiều phụ kiện phức tạp.</p>\r\n\r\n<p><img alt=\"Asus Vivobook A1503ZA-L1421W | Connectors\" src=\"https://storage.googleapis.com/teko-gae.appspot.com/media/image/2022/10/8/20221008_9c74299a-748e-413d-a4d9-7dcbf5720698.png\" /></p>\r\n\r\n<p>Using Asus home products, you can easily connect to the internet thanks to<strong>&nbsp;WiFi 802.11ax (Wifi 6)</strong>&nbsp;which always ensures a stable connection.&nbsp;<strong>The new generation Bluetooth 5.1</strong>&nbsp;makes it easy to connect to mobile devices to easily transmit the necessary information.</p>',1.700,'35.68 x 22.76 x 1.99','HD','Windows 11',70,24,'2023-03-10 12:52:43','2023-03-10 12:52:43');
