CREATE TABLE `products` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `manufacture_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `cpu_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `ram_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `ssd_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `hdd_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `screen_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `resolution_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `series_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `demand_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `gpu_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `color_id` bigint(20) unsigned NOT NULL DEFAULT 1,
  `slug` varchar(255) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `products_ram_id_foreign` (`ram_id`),
  KEY `products_cpu_id_foreign` (`cpu_id`),
  KEY `products_manufacture_id_foreign` (`manufacture_id`),
  KEY `products_screen_id_foreign` (`screen_id`),
  KEY `products_hdd_id_foreign` (`hdd_id`),
  KEY `products_ssd_id_foreign` (`ssd_id`),
  KEY `products_color_id_foreign` (`color_id`),
  KEY `products_gpu_id_foreign` (`gpu_id`),
  KEY `products_demand_id_foreign` (`demand_id`),
  KEY `products_series_id_foreign` (`series_id`),
  KEY `products_resolution_id_foreign` (`resolution_id`),
  CONSTRAINT `products_color_id_foreign` FOREIGN KEY (`color_id`) REFERENCES `colors` (`id`),
  CONSTRAINT `products_cpu_id_foreign` FOREIGN KEY (`cpu_id`) REFERENCES `cpus` (`id`),
  CONSTRAINT `products_demand_id_foreign` FOREIGN KEY (`demand_id`) REFERENCES `demands` (`id`),
  CONSTRAINT `products_gpu_id_foreign` FOREIGN KEY (`gpu_id`) REFERENCES `gpus` (`id`),
  CONSTRAINT `products_hdd_id_foreign` FOREIGN KEY (`hdd_id`) REFERENCES `hdds` (`id`),
  CONSTRAINT `products_manufacture_id_foreign` FOREIGN KEY (`manufacture_id`) REFERENCES `manufactures` (`id`),
  CONSTRAINT `products_ram_id_foreign` FOREIGN KEY (`ram_id`) REFERENCES `rams` (`id`),
  CONSTRAINT `products_resolution_id_foreign` FOREIGN KEY (`resolution_id`) REFERENCES `resolutions` (`id`),
  CONSTRAINT `products_screen_id_foreign` FOREIGN KEY (`screen_id`) REFERENCES `screens` (`id`),
  CONSTRAINT `products_series_id_foreign` FOREIGN KEY (`series_id`) REFERENCES `series` (`id`),
  CONSTRAINT `products_ssd_id_foreign` FOREIGN KEY (`ssd_id`) REFERENCES `ssds` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=78 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
